INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(59174, 'esES', 'Short-Supply Reward', '', '', '', '', '', '', '', '', 33528),
(59173, 'esES', 'Short-Supply Reward', '', '', '', '', '', '', '', '', 33528),
(59019, 'esES', 'Llamamiento a las armas: Uldum', 'Mata a miembros de la Horda en Uldum.', 'La incursión de la Horda pone en riesgo nuestra misión en Uldum.\n\nVe a Uldum y acaba con tantos como puedas.', '', '', '', '', '', '', 33528),
(59018, 'esES', 'Llamamiento a las armas: Valle de la Flor Eterna', 'Mata a miembros de la Horda en el Valle de la Flor Eterna.', 'La incursión de la Horda pone en riesgo nuestra misión en el Valle de la Flor Eterna.\n\nVe al valle y acaba con tantos como puedas.', '', '', '', '', '', '', 33528),
(59017, 'esES', 'Llamamiento a las armas: Valle de la Flor Eterna', 'Mata a miembros de la Alianza en el Valle de la Flor Eterna.', 'Nuehtroh objetivoh en el Valle de la Flor Eterna sufren interrupcioneh por la llegada de la ehcoria de la Alianza.\n\nElimina de la zona a todoh loh que puedah y vuelve pa informar.', '', '', '', '', '', '', 33528),
(59016, 'esES', 'Llamamiento a las armas: Uldum', 'Mata a miembros de la Alianza en Uldum.', 'Nuehtroh objetivoh en Uldum sufren interrupcioneh por la llegada de la ehcoria de la Alianza.\n\nElimina de la zona a todoh loh que puedah y vuelve pa informar.', '', '', '', '', '', '', 33528),
(59000, 'esES', 'Elementos de corrupción', 'Habla con MADRE para saber más acerca de los objetos corruptos.', 'La corrupción se comporta de manera misteriosa. Se extiende más allá de Azeroth, se aferra a nuestros pensamientos más íntimos y hasta puede corromper reliquias, como habrás notado.\n\nAunque no conozco de primera mano los efectos que esto produce, seguro que MADRE tiene información sobre estos objetos de corrupción.', '', '', '', '', '', '', 33528),
(58991, 'esES', 'Corrupción curiosa', 'Busca respuestas sobre el objeto corrupto en la Cámara del Corazón.', '<Hay algo extraño que te llama la atención de este objeto en particular. Puede que alguien en la cámara sepa algo acerca de su origen>.', '', '', '', '', '', '', 33528),
(58990, 'esES', 'Huevo de titanus', '', '', '', '', '', '', '', '', 33528),
(58989, 'esES', 'Introducción a la forja de runas', 'Usa la facultad Forja de runas de tu libro de hechizos para grabar una runa en tu arma.\n\nPuedes cambiar libremente el grabado en cualquier momento, siempre que estés cerca de una forja de runas.', 'Como caballeros de la Espada de Ébano, debemos estar siempre preparados para diversas situaciones marciales. Para ello, tuyo es el arte oscuro de la forja de runas. Con él puedes grabar runas de gran poder en tus armas.\n\nSobre nosotros, en El Corazón de Acherus, hay forjas de runas. Visita una y usa tu poder para imbuir un arma con una runa de poder.', 'Arma blasonada', '', '', '', '', '', 33528),
(58981, 'esES', 'Colmena aguerrida', '', '', '', '', '', '', '', '', 33528),
(58974, 'esES', 'Colonos emboscados', '', '', '', '', '', '', '', '', 33528),
(58961, 'esES', 'Colonos emboscados', '', '', '', '', '', '', '', '', 33528),
(58952, 'esES', 'Llamas purgantes', '', '', '', '', '', '', '', '', 33528),
(58904, 'esES', 'Fragmentos de corrupción', 'Reúne $0oa fragmentos de corrupción.', '<Sientes la influencia de algo oscuro e inhumano en tu mente, sus retorcidos tentáculos asaltan y consumen tu cordura. Sientes la obligación de conseguir más fragmentos... Todos ellos>.', '', '', '', '', '', 'Localiza el ídolo de iniquidad.', 33528),
(58903, 'esES', 'Defensor de Azeroth', 'Habla con el alto señor Darion Mograine. Luego, usa el portón de la muerte del alto señor para viajar a Orgrimmar. Una vez allí, elige en el tablón de mando del jefe de guerra.', 'Excelente elección.\n\nSe acercan tiempos difíciles. Al ser parte de los elegidos, tienes la carga y el privilegio de defender nuestro mundo. Es un gran honor.\n\nPero también debes saber que encontrarás el desprecio de los ignorantes. A menudo, los mortales son incapaces de ver más allá de nuestra apariencia temible. Ignora a esos necios y haz lo que hay que hacer.\n\nHabla con tu comandante, y luego usa su portón de la muerte para viajar a la tierra de los vivos y elegir tu destino.', '', '', '', '', '', '', 33528),
(58902, 'esES', 'Defensor de Azeroth', 'Habla con el alto señor Darion Mograine. Luego, usa el portón de la muerte del alto señor para viajar a Ventormenta. Una vez allí, elige en el tablero de ¡Se busca héroe!', 'Excelente elección.\n\nSe acercan tiempos difíciles. Al ser parte de los elegidos, tienes la carga y el privilegio de defender nuestro mundo. Es un gran honor.\n\nPero también debes saber que encontrarás el desprecio de los ignorantes. A menudo, los mortales son incapaces de ver más allá de nuestra apariencia temible. Ignora a esos necios y haz lo que hay que hacer.\n\nHabla con tu comandante, y luego usa su portón de la muerte para viajar a la tierra de los vivos y elegir tu destino.', '', '', '', '', '', '', 33528),
(58887, 'esES', 'Hay una alpaca en ti', '', '', '', '', '', '', '', '', 33528),
(58881, 'esES', 'Misión de rastreo', '', '', '', '', '', '', '', '', 33528),
(58879, 'esES', 'Una alpaca de traca', '', '', '', '', '', '', '', '', 33528),
(58877, 'esES', 'El poder de la Muerte crece', 'Jura lealtad al Rey Exánime.', 'Escucha con atención, $n. En el horizonte se atisba una época de gran destrucción que pondrá en peligro nuestra existencia misma. Ahora, más que nunca, debemos alzarnos para defender Azeroth.\n\nPor eso he ampliado el número de mis campeones para incluir a los de tu raza. Tu sacrificio te distingue de todos los demás. Ve con la cabeza bien alta. Serás para siempre $gun:una; caballero de la Muerte de la Espada de Ébano.\n\nAhora jura lealtad.', '', '', '', '', '', '', 33528),
(58876, 'esES', 'Vuelo perdido', 'Llévale el engendro de Vexiona a Wrathion, que está en la Cámara del Corazón.', '<Un pequeño dragón sale de una de las cámaras laterales que hay en el gran caparazón de N\'Zoth. Parece desconcertado.\n\nSupones que esas cámaras se habrán utilizado para corromper a los dragones, exponiéndolos directamente a los susurros oscuros de N\'Zoth. A una edad temprana, eso debe de enloquecerlos, más que a ningún otro miembro del Vuelo Crepuscular que hayas visto antes.\n\nSería imposible recuperarse de una locura así.\n\nPero tal vez para este no sea demasiado tarde...>.', '', '', '', '', '', '', 33528),
(58866, 'esES', 'Mi propio zángano', 'Llévale la silla de montar de otro mundo a H\'partho Ardoros, que está en Ramkahen.', 'La silla de montar está lista. No es que haya disfrutado trabajando ese metal corrupto, pero he de reconocer que es sin duda la mejor silla que he fabricado.\n\nSé que tiene un aspecto... agresivo, pero te aseguro que a tu aqir le resultará muy cómoda.\n\nEspero que te sea útil.', '', '', '', '', '', '', 33528),
(58865, 'esES', 'Armamentos de otro mundo', 'Reúne $1oa armamentos del Imperio Negro de cultores del Imperio Negro en Uldum y en el Valle de la Flor Eterna.', 'Para fabricar una silla de montar para tu bestia, voy a necesitar algunos materiales especiales. Más que nada, me harán falta metales mucho más ligeros de los que ya tenemos.\n\nHe observado que los cultores del Imperio Negro llevan armas hechas de materiales de otro mundo, increíblemente ligeros y fuertes.\n\nSi pudieras conseguirme unas cuantas de esas armas, podría fundir ese metal y fabricar con él una silla de montar para el aqir.', '', '', '', '', '', '', 33528),
(58863, 'esES', 'Un pedido personalizado', 'Habla con el herrero Abasi, que está en Ramkahen.', 'Creo que podemos decir que nuestro amiguito ya no es una cría, ¡sino un aqir hecho y derecho! Es más, ha crecido tanto que hasta podría llevarte a ti a la batalla.\n\n¡Un momento, es una idea fabulosa!\n\nDeberías hablar con el herrero Abasi para que te haga una silla de montar.', '', '', '', '', '', '', 33528),
(58862, 'esES', 'El pequeño defensor', 'Derrota al defensor de piedra baruk en un duelo de mascotas con la cría puasombría en tu grupo.', 'Los mogu baruk son conocidos por dar vida a estatuas antiguas para que les defiendan el territorio. Son adversarios resistentes, y se puede aprender mucho al enfrentarse a un enemigo con unas defensas tan sólidas.\n\nPor suerte, parece que uno de sus labrapiedras ha dado vida por error a un ídolo pequeño. El mogu que lo hizo lo ha desechado por considerarlo inútil, pero podría ser una valiosa baza para el entrenamiento de nuestra cría.\n\nBusca a ese defensor en miniatura en el Valle de la Flor Eterna.', '', '', '', '', '', '', 33528),
(58861, 'esES', 'El valor de un mántide', 'Derrota a la prole Vil\'thik en un duelo de mascotas con la cría puasombría en tu grupo.', 'Observar las técnicas de combate de los mántides puede resultar útil para el entrenamiento de nuestra cría, ya que es una forma distinta de usar las armas naturales de un insecto.\n\nHe encontrado en el Valle de la Flor Eterna a un oponente mántide al que nuestra cría podría enfrentarse. Llévatela allí, a ver qué tal le va.', '', '', '', '', '', '', 33528),
(58860, 'esES', 'Alfazaque duro de pelar', 'Derrota al reptador de arena aqir en un duelo de mascotas con la cría puasombría en tu grupo.', 'Podría ser bueno para nuestra cría que se enfrentara a otro aqir, para que aprenda de lo que son capaces los de su especie.\n\nHe encontrado un oponente que podría ser un buen reto.', '', '', '', '', '', '', 33528),
(58859, 'esES', 'Alguien de su tamaño', 'Derrota a Retinus el Buscador en un duelo de mascotas con la cría puasombría en tu grupo.', 'Es cierto que pelear a tu lado es sin duda un entrenamiento excelente para nuestra cría, pero a veces es mejor dejar que luche sola contra enemigos de su talla.\n\nSé de un contrincante así que se encuentra en las proximidades, observando a los amathet cerca del Obelisco de las Estrellas. Deberías ir a buscarlo.', '', '', '', '', '', '', 33528),
(58858, 'esES', 'Más filetes fétidos', 'Reúne $1oa trozos de carne corrupta de criaturas que se encuentren en zonas que estén sufriendo el asalto de los esbirros de N\'Zoth.', 'Nuestro chiquitín ya vuelve a tener hambre.\n\n¿Podrías conseguirle alguna cosilla de comer?', '', '', '', '', '', '', 33528),
(58831, 'esES', 'Afinar los instintos', 'Usa el silbato de H\'partho para invocar a tu cría aqir y enfréntate a enemigos en Uldum o en el Valle de la Flor Eterna. Enfrentarse a enemigos fuertes o poco comunes ayudará a que la cría crezca más rápido.', 'Parece que nuestro amiguito está ansioso por seguir practicando el combate.\n\n¿Te importaría enseñarle los fundamentos?', '', '', '', '', '', '', 33528),
(58830, 'esES', 'Instintos aqir', 'Usa el silbato de H\'partho para invocar a tu cría aqir y enfréntate a enemigos en Uldum o en el Valle de la Flor Eterna. Enfrentarse a enemigos fuertes o poco comunes ayudará a que la cría crezca más rápido.', 'He observado el enfrentamiento entre los aqir y los Vagayermos, y he comprobado que los recién nacidos se unen de inmediato al asalto aqir. Parece que la necesidad de combatir es innata en estas criaturas.\n\nDeberíamos ejercitar a nuestra cría, bajo tu supervisión, claro está. Llévatelo y enséñale a luchar contra nuestros enemigos.\n\nTal vez no pueda luchar durante mucho tiempo, así que no lo llames hasta que estés $glisto:lista; para entrenarlo.\n\nCon suerte, acabará viéndonos como parte de su colmena.', '', '', '', '', '', '', 33528),
(58829, 'esES', '¡Crecen tan rápido!', 'Ayuda a la larva aqir a salir de su capullo en Ramkahen.', '¡Mira! ¡Nuestra larva ha pasado a la fase de crisálida!\n\nEspera... Parece que está a punto de salir.\n\n¡Vamos, échale una mano!', '', '', '', '', '', '', 33528),
(58826, 'esES', 'Una delicia sangrienta', 'Reúne $1oa viales de ánima purificada de los mogu dokani en el Valle de la Flor Eterna.', 'He oído que un clan de los mogu al que llaman los dokani sabe cómo utilizar la fuerza vital para crear una sustancia que denominan \"ánima\".\n\nSi se trata en efecto de vida condensada en forma líquida, podría tener unas propiedades espectaculares para nuestra larva aqir.\n\nVe e intenta traerme un poco de esa ánima en una forma que podamos utilizar. ¡A ver si a nuestro amiguito le gusta!', '', '', '', '', '', '', 33528),
(58825, 'esES', 'Superjalea', 'Reúne $1oa muestras de jalea real concentrada en el Valle de la Flor Eterna.', 'Mis amigos del Loto Dorado me han contado cosas muy interesantes sobre el nuevo enjambre mántide. Se ve que han desarrollado una jalea real concentrada que acelera el crecimiento de los mántides recién salidos del cascarón.\n\nY si esa jalea funciona con los mántides, ¡lo lógico sería que también funcionara con los aqir!\n\nA ver si puedes encontrar una muestra suficiente como para que ayude a crecer a nuestra larva.', '', '', '', '', '', '', 33528),
(58818, 'esES', 'Bichos buenos', 'Atrapa $1oa crías de arenisca dóciles en Uldum.', '¿Soy yo, o nuestro amiguito tiene pinta de sentirse solo? Tendría sentido que los aqir fueran criaturas sociales, ya que vienen de una colmena y tal. Para él debe de ser difícil no tener a nadie de los suyos cerca.\n\nOye, tal vez podrías buscarle amigos. Nada que sea grandote y dé miedo, claro, pero tal vez unos escarabajos de los más pequeños bastarían para hacerle compañía.\n\n¿Qué te parece?', '', '', '', '', '', '', 33528),
(58817, 'esES', 'Figuras de acción', 'Reúne $1oa figurillas amathet de las criaturas amathet de Uldum.', 'He pensado que nuestra larva lleva una vida bastante aburrida. Deberíamos buscar algo que la tenga entretenida.\n\n¡Al fin y al cabo, una larva feliz es una larva sana!\n\nCreo que los amathet tienen figuras para adorar a sus dioses. Seguro que también podrían servir como juguetes para nuestro amiguito. ¡A ver si encuentras unas cuantas!', '', '', '', '', '', '', 33528),
(58813, 'esES', 'Filetes fétidos', 'Reúne $1oa trozos de carne corrupta de criaturas que se encuentren en zonas que estén sufriendo el asalto de los esbirros de N\'Zoth.', '¿Sabes? He pensado que, como esta criatura está imbuida de energía del Vacío, tal vez prefiera una fuente de comida más... corrupta.\n\nHablo, por supuesto, de los esbirros de N\'Zoth.\n\nEs una posibilidad remota, pero por probar que no quede.', '', '', '', '', '', '', 33528),
(58812, 'esES', 'Sustitutos de la carne', 'Reúne $1oa trozos de carne de insectoide de los aqir, de los mántides o de cualquier insecto en Uldum o en el Valle de la Flor Eterna.', 'En la naturaleza es bastante habitual que los insectos se coman a otros de su especie. Me pregunto si con los aqir será igual.\n\n¿Podrías traerme carne de aqir o de mántide? A ver si eso le resulta más apetecible a nuestro amigo.', '', '', '', '', '', '', 33528),
(58811, 'esES', 'Una dieta equilibrada', 'Reúne $1oa trozos de carne de bestias de Uldum y del Valle de la Flor Eterna.', 'Ahora que la larva ha salido del huevo, tendremos que averiguar qué darle de comer para que se mantenga sana.\n\nPor lo visto los aqir son carnívoros, pero lo único que les he visto comer es... en fin... a nosotros.\n\nY no vamos a darle de comer gente a nuestro pequeñín, claro, así que habrá que buscar una alternativa. ¿Y si le diéramos carne animal como sucedáneo?', '', '', '', '', '', '', 33528),
(58810, 'esES', 'Salir del cascarón', 'Observa cómo eclosiona el huevo aqir en Ramkahen.', '¡Parece que nuestro huevo está listo para eclosionar! ¡¿No es emocionante?!\n\nVamos, démosle la bienvenida a este mundo a nuestro nuevo amiguito.', '', '', '', '', '', '', 33528),
(58809, 'esES', 'Una técnica electrizante', 'Reúne $1oa componentes de pararrayos en el Valle de la Flor Eterna.', 'He oído historias que dicen que los mogu usan relámpagos para acelerar el crecimiento de sus dragones nimbo. Me pregunto si podríamos usar el mismo principio para nuestro amigo aqir.\n\n¡Solo hay un modo de averiguarlo! Ve al Valle de la Flor Eterna e intenta reunir todas las piezas necesarias para hacernos nuestros propios pararrayos.\n\nSi funcionan igual que con los dragones nimbo, el proceso de incubación debería acelerarse considerablemente.', '', '', '', '', '', '', 33528),
(58808, 'esES', 'Encerrado en ámbar', 'Marca una incubadora de ámbar para que H\'partho la transporte por aire en el Valle de la Flor Eterna.', '¿Sabes quiénes deben de saber mucho sobre cómo incubar este huevo como es debido? ¡Los mántides!\n\nYa, ya sé que están demasiado ocupados intentando matarnos, ¡pero tal vez haya otro modo de aprovechar sus conocimientos!\n\nQuizás podríamos reconvertir una de sus cámaras de incubación. ¡Eso ayudaría a acelerar el proceso, sin ninguna duda!\n\nSi pudieras encontrar una y señalármela, podría sacarla por aire de allí.', '', '', '', '', '', '', 33528),
(58807, 'esES', 'Estrategia envolvente', 'Reúne $1oa trozos de telaraña aqir de los taumaturgos aqir en Uldum.', 'Una cosa rara que he observado en este huevo es que carece de la telaraña protectora que suele haber en las colmenas aqir.\n\nCreo que esa tela tiene cualidades protectoras, y si consiguiéramos un poco sería beneficiosa para nuestro huevo.\n\nMientras estás por ahí luchando con los insectos, a ver si puedes traerme parte de su telaraña para poder hacerle a nuestro huevo un capullo como corresponde.', '', '', '', '', '', '', 33528),
(58806, 'esES', 'La calidez del sol', 'Consigue un recolector solar amathet en Uldum.', 'Las noches pueden ser terriblemente frías en el desierto de Uldum. Temo que nuestro pequeño huevo no sea capaz de resistir estas temperaturas.\n\nLos amathet que hay al este parecen dominar el uso de la energía solar. Si pudiéramos asimilar parte de su pericia, podríamos usarla para mantener el huevo bien calentito.\n\nEstate $gatento:atenta; a cualquier cosa que nos pueda servir.', '', '', '', '', '', '', 33528),
(58805, 'esES', 'Incubación continua', 'Reúne $1oa cristales de Vacío en zonas que estén sufriendo el asalto de las tropas de N\'Zoth.', 'El huevo va bien, pero necesitaremos más cristales de Vacío para que siga así.\n\n¿Podrías salir a por más?', '', '', '', '', '', '', 33528),
(58804, 'esES', 'Incubación del Vacío', 'Reúne $1oa cristales de Vacío en zonas que estén sufriendo el asalto de las tropas de N\'Zoth.', 'Bueno, una cosa es segura: este huevo necesita grandes cantidades de energía del Vacío para salir adelante.\n\nQué suerte que justo en este momento haya un dios antiguo atacando Azeroth, ¿no?\n\nAh, ¿que no? Oh...\n\nEn cualquier caso, seguro que hay un montón de energía del Vacío dondequiera que ataquen los esbirros de N\'Zoth. Deberías salir a buscar un poco.', '', '', '', '', '', '', 33528),
(58803, 'esES', 'Eclosión con parangón', 'Investiga $1oa huevos tocados por el Vacío en Uldum.', 'No temas, seguro que no pasa nada malo por incubar esta criatura. Al fin y al cabo, los aqir no pueden ser malvados por naturaleza, ¿no?\n\nClaro que no tenemos ni idea de cómo cuidar un huevo así. Necesitaré que investigues un poco.\n\nVuelve a las colmenas aqir, a ver si encuentras otros huevos parecidos. Si te fijas en cómo los tratan, tal vez podamos aplicar aquí esos conocimientos.', '', '', '', '', '', '', 33528),
(58802, 'esES', 'El huevo increíble', 'Llévale el huevo tocado por el Vacío a H\'partho Ardoros, que está en Ramkahen.', '<Por lo visto los aqir querían potenciar este huevo con magia del Vacío.\n\nParece faltarle mucho para eclosionar, por lo que debería poder estudiarse sin riesgo con el fin de averiguar qué pretendían hacer con él.\n\nTal vez a alguien de la Liga de Expedicionarios le interese echarle un vistazo>.', '', '', '', '', '', '', 33528),
(58801, 'esES', 'Adentrarse en el Vacío', 'Sacrifica a 10 jugadores para N\'Zoth sin morir ni abandonar la forma de ánima del Vacío.', '<Al acercarte al ídolo, los fragmentos oscuros que llevas encima parecen derretírsete en la mano. Enseguida te entra una angustia indescriptible, que pronto da paso a sentimientos de alegría, serenidad y un deseo abrumador de... matar>.\n\n<Una voz sibilante se cuela en tu mente>.\n\nMi fiel sirviente. Te otorgaré una pequeñísima muestra de mi inimaginable poder. Lo único que te pido a cambio es una tarea sencilla. Mata a todo aquel que se me oponga, sin excepción. No me falles...', '', '', '', '', '', '', 33528),
(58782, 'esES', 'Cosas que quedaron atrás', 'Consigue $1oa suministros de Vagayermos de los alijos infestados de Uldum.', 'Los invasores aqir han obligado a los Vagayermos a huir de muchos de nuestros asentamientos en Uldum. Con las prisas por escapar, nos dejamos muchas cosas.\n\nTengo entendido que vas a enfrentarte a esas bestias. Ya que estás, ¿podrías echar un ojo por si ves alguno de los suministros que tuvimos que dejar atrás?\n\nPuedes quedarte lo que te resulte útil, claro.', '', '', '', '', '', '', 33528),
(58781, 'esES', 'Terrores de las profundidades', 'Derrota a 3 enemigos aqir poco comunes en Uldum.', 'Los aqir amenazan el sustento de los Vagayermos con cada día que pasa, pero he oído que junto a ellos han surgido terrores aún peores.\n\nNuestros luchadores son competentes, pero temo lo que podría pasar si uno de esos horrores ancestrales cayera sobre nosotros.\n\nSé que tú tienes experiencia en liquidar a grandes enemigos. Me gustaría pedirte que hicieras lo mismo por nosotros.\n\nAl fin y al cabo, difícilmente podremos ayudar a proteger la forja si acabamos aniquilados por un monstruo que llevaba siglos enterrado.', '', '', '', '', '', '', 33528),
(58780, 'esES', 'Heraldos de la colmena', 'Mata a $1oa dominadores aqir en Uldum.', 'Los aqir que han atacado nuestro campamento parecen estar compuestos básicamente por tropas de asalto. No obstante, los exploradores que se han atrevido a ir detrás de sus líneas han visto un tipo de criatura diferente: es alta y delgada, y utiliza una peligrosa magia del Vacío.\n\nMi instinto me dice que esas criaturas son quienes dirigen esta invasión. Deberíamos considerarlas blancos de oportunidad y liquidarlas allí donde aparezcan.\n\n¿Te ves capaz?', '', '', '', '', '', '', 33528),
(58779, 'esES', 'El dominio del cielo', 'Mata a $1oa aqir voladores en Uldum.', 'Me gustaría desplegar algunas tropas aéreas para expulsar a los aqir, pero es casi imposible volver al Obelisco del Sol con tanto bicho volando por ahí.\n\nCreo que tendremos que reducir su número en tierra si queremos conseguir superioridad aérea.\n\n¿Puedo contar con tu ayuda?', '', '', '', '', '', '', 33528),
(58778, 'esES', 'Descabezar al enemigo', 'Consigue $1oa trofeo de goliat de los goliats aqir en Uldum.', 'Últimamente la moral anda por los suelos en el campamento. Es curioso cómo unos cuantos mordiscos de bichos pueden arruinar el ambiente de un lugar.\n\nPero tengo una idea para animar a las tropas. ¡Necesitamos un trofeo!\n\nIntenta traerme la cabeza de uno de esos grandotes con aspecto de tanque para poder exhibirla y que los bichos esos sepan que vamos en serio. Pero que no esté muy maltrecha, ¿vale?', '', '', '', '', '', '', 33528),
(58777, 'esES', 'Pisar con firmeza', 'Aplasta $1oa larvas aqir en Uldum.', '<Zahra pisotea una criatura viscosa similar a una babosa>.\n\n¿Lo has visto? Parecen insignificantes, pero, por increíble que parezca, esos bichos salen de esto.\n\nEstán por todas partes en las zonas invadidas por los aqir, alimentándose de nuestros muertos y creciendo hasta convertirse en esas monstruosidades.\n\nSi por casualidad ves alguna, hazle un favor al mundo y despachúrrala.', '', '', '', '', '', '', 33528),
(58776, 'esES', 'Problemas en eclosión', 'Destruye $1oa pilas de huevos aqir en Uldum.', 'Los aqir se multiplican más deprisa de lo que los matamos. A este paso no tardarán en superarnos en número.\n\nLa única manera de frenar su asalto es atacar directamente sus colmenas y destruir sus huevos, pero hasta ahora no lo hemos logrado.\n\nPor eso deseo reclutar tus servicios.\n\n¿Quieres ayudarnos?', '', '', '', '', '', '', 33528),
(58765, 'esES', 'Rompeasedios', 'Sabotea $1oa carros de guerra Vil\'thik en el Valle de la Flor Eterna.', 'El Loto Dorado es capaz de defenderse de los guerreros mántides, de eso no me cabe duda. Sus carros de guerra, en cambio, pueden inutilizar a todo un escuadrón de nuestros soldados con una sola andanada.\n\nSi queremos conservar la ventaja en esta batalla, necesitaremos a alguien que se infiltre en sus posiciones y sabotee sus máquinas de asedio.\n\nMe gustaría que te ofrecieses tú.', '', '', '', '', '', '', 33528),
(58764, 'esES', 'Estandartes del enjambre', 'Quema $1oa estandartes Zara\'thik en el Valle de la Flor Eterna.', 'Esos mántides descarados se creen que ya han ganado. Ya hasta hacen ondear sus estandartes a lo largo del Espinazo del Dragón, anunciando su dominio.\n\nHay que enseñarles que Pandaria es de los pandaren.\n\nQuema sus estandartes.', '', '', '', '', '', '', 33528),
(58763, 'esES', 'Detener la producción', 'Destruye $1oa receptáculos de ámbar en el Valle de la Flor Eterna.', 'Los mántides usan ámbar en casi todos los aspectos de su vida, desde las construcciones en las que viven hasta las armas que empuñan. A mí, por supuesto, lo que más me interesa es eso último.\n\nSi podemos privar a los mántides de sus materiales, también los despojaremos de los medios para crear instrumentos de guerra.\n\nAverigua dónde guardan el ámbar y asegúrate de que no puedan usarlo.', '', '', '', '', '', '', 33528),
(58762, 'esES', 'En manos del enjambre', 'Libera a $1oa prisioneros del Loto Dorado de las jaulas de ámbar endurecido en el Valle de la Flor Eterna.', 'Hay algo diferente en este enjambre mántide. En vez de matar todo lo que ven, como suelen hacer los mántides, han decidido capturar a nuestros defensores y mantenerlos con vida.\n\nNo quiero ni imaginar qué les espera a los prisioneros.\n\n¿Por qué no vas a rescatarlos para no tener que averiguarlo?', '', '', '', '', '', '', 33528),
(58761, 'esES', 'Pisoteadas', 'Mata $1oa larvas Vil\'thik en el Valle de la Flor Eterna.', 'Antiguamente, los mántides protegían a sus crías en cámaras de incubación hasta que estaban listas para ser puestas a prueba en el enjambre.\n\nPero esos Vil\'thik son torpes, y permiten que sus larvas escapen y se queden al aire libre.\n\n¿No sería una pena que alguien las aplastara?\n\nNo, la verdad es que no.', '', '', '', '', '', '', 33528),
(58760, 'esES', 'Hojas de ámbar', 'Consigue $1oa hojas de ámbar de los mántides Vil\'thik en el Valle de la Flor Eterna.', 'Los mántides son frágiles y fáciles de quebrar, pero las hojas de ámbar que blanden son formidables.\n\nCon un poco de trabajo, se podrían remodelar y hacerlas más apropiadas para los mogu.\n\nTráemelas e intentaré modificarlas para que sirvan a los rajani.', '', '', '', '', '', '', 33528),
(58759, 'esES', 'La guardia de la emperatriz', 'Mata $1oa mántides Zara\'thik en el Valle de la Flor Eterna.', 'Los Zara\'thik son la guardia de élite de la emperatriz. Están potenciados con azerita saqueada, y no se detendrán hasta lograr la conquista absoluta de toda Pandaria.\n\nSi les permitimos avanzar más allá del Espinazo del Dragón, el Loto Dorado no será rival para ellos.\n\nDetenlos en el muro, $c.', '', '', '', '', '', '', 33528),
(58758, 'esES', 'Destructores arrasadores', 'Mata $1oa destructores kunchong en el Valle de la Flor Eterna.', 'El último enjambre mántide está aún muy fresco en la memoria del Loto Dorado. Antes del avance del enjambre, los mántides enviaban a sus enormes kunchong a debilitar las líneas de los defensores.\n\nY parece que sus tácticas no han cambiado.\n\nDebemos detener a esos kunchong si el Loto Dorado espera organizar una defensa contra el enjambre. Cuento contigo para acabar con ellos.', '', '', '', '', '', '', 33528),
(58757, 'esES', 'Probar a los no probados', 'Mata $1oa enjambrenatos Vil\'thik en el Valle de la Flor Eterna.', 'Durante un enjambre, los mántides envían a un gran número de sus jóvenes contra el enemigo para que demuestren su valía. Los que sobreviven se unen al enjambre como auténticos guerreros de los mántides.\n\nDeberíamos hacer lo posible para que no superen la prueba.', '', '', '', '', '', '', 33528),
(58756, 'esES', 'Ensalmadores terroríficos', 'Mata a $1oa taumaturgos de ámbar mántides en el Valle de la Flor Eterna.', 'Los taumaturgos de ámbar se cuentan entre las castas superiores de la sociedad mántide. Con su magia pueden reparar y dar forma al ámbar a voluntad, lo que permite que las tropas mántides se recuperen rápidamente tras una batalla.\n\nSon objetivos estratégicos que deberíamos localizar.\n\n¿Te apuntas?', '', '', '', '', '', '', 33528),
(58755, 'esES', 'Suministros ocultos', 'Consigue $1oa suministros del Loto Dorado de los alijos de ámbar en el Valle de la Flor Eterna.', 'Últimamente los mántides invasores se han estado llevando los suministros del Loto Dorado. Deben de contar con que nos muramos de hambre.\n\nY eso es lo que pasará si no logramos recuperar algunas de nuestras provisiones.\n\nMientras estés enfrentándote al enjambre, estate $gatento:atenta; por si ves algún sitio donde puedan haber escondido nuestros suministros. Le harías un gran favor al Loto Dorado si recuperases unos cuantos.', '', '', '', '', '', '', 33528),
(58754, 'esES', 'Campeones del enjambre', 'Derrota a 3 enemigos mántides poco comunes en el Valle de la Flor Eterna.', 'Es evidente que Shek\'zara está del todo implicada en esta invasión. Nuestros exploradores han visto a algunos de sus principales campeones en el campo de batalla.\n\nCualquiera de esos mántides sería demasiado para los soldados del Loto Dorado. Debemos darles caza y eliminarlos nosotros.\n\n¿Te apuntas?', '', '', '', '', '', '', 33528),
(58749, 'esES', 'Vuelo de los Vil\'thik', 'Derrota a Grixis Chiquipum en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58748, 'esES', 'Las estatuas vivientes son cosa dura', 'Derrota a Grixis Chiquipum en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58747, 'esES', 'Cosquillas cerebrales', 'Derrota a Grixis Chiquipum en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58746, 'esES', 'Locura diminuta', 'Derrota a Grixis Chiquipum en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58745, 'esES', 'Cuidado por dónde pisas', 'Derrota a Grixis Chiquipum en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58744, 'esES', 'Soy quien susurra', 'Derrota a Grixis Chiquipum en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58743, 'esES', 'Bicho de las dunas', 'Derrota a Grixis Chiquipum en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58742, 'esES', 'Retinus el Buscador', 'Derrota a Grixis Chiquipum en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58741, 'esES', 'Piedra de corte', 'Consigue $1oa armamentos mogu en el Valle de la Flor Eterna.', 'Uno de los problemas de enfrentarse a otros mogu es que las armas se mellan y rompen enseguida al usarlas contra adversarios de piedra y metal.\n\nComo soy el único herrero de los rajani, a veces me cuesta seguir el ritmo que necesitan nuestros guerreros.\n\nSi encuentras armas en tus batallas con los mogu, seguro que les daría buen uso.', '', '', '', '', '', '', 33528),
(58740, 'esES', 'Sierpes subyugadas', 'Mata $1oa sierpes de guerra de ónice en el Valle de la Flor Eterna.', 'Allí donde van los Zan-Tien, los siguen las sierpes de guerra.\n\nNo te imaginas lo peligrosas que son esas bestias. Es una pena verlas subyugadas por los mogu, pero tampoco podemos dejar que campen a sus anchas.\n\nNecesito que acabes con ellas antes de que causen estragos en nuestras filas.', '', '', '', '', '', '', 33528),
(58737, 'esES', 'Descubrimientos de Magni', 'Infórmate sobre los descubrimientos de Magni.', 'Por si no fuera suficiente con volver a hacer funcionar la forja, creo que en los archivos de las Cámaras Mogu\'shan podríamos haber dado con la clave para acabar con N\'Zoth de una vez por todas.\n\nMás vale que te sientes, adalid.', '', '', '', '', '', '', 33528),
(58708, 'esES', 'Gnomotoriedad', 'Reúnete con el maestro manitas Sobrechispa en Boralus.', 'El maestro manitas Sobrechispa solicita tu asistencia con una misión de investigación importante.\n\nNo lo dudes, trabajar con el reconocido maestro manitas será beneficioso para tu carrera. ¡Ha hecho maravillas por la mía!', '', '', '', '', '', '', 33528),
(58705, 'esES', 'Gran emperatriz Shek\'zara', '', '', '', '', '', '', '', '', 33528),
(58679, 'esES', 'Destructor durmiente', '', '', '', '', '', '', '', '', 33528),
(58675, 'esES', 'El precio de la paz', 'Asiste al discurso del rey Wrynn.', 'El rey se dirigirá a nosotros en breve con noticias de su misión diplomática con la Horda.\n\nLos demás líderes de la Alianza ya han llegado. Seguro que se mueren por saber qué cuenta el rey Wrynn.\n\nHabla conmigo cuando estés $glisto:lista; y saludaremos juntos al rey.', '', '', '', '', '', '', 33528),
(58674, 'esES', 'Una reunión de campeones', 'Habla con el maestro Mathias Shaw en Ventormenta.', 'El rey Wrynn ha pedido una audiencia con los líderes de la Alianza en Ventormenta.\n\nTu presencia en la reunión se ha solicitado de forma específica. La reunión se celebrará en la embajada.\n\nVen a verme cuando llegues a Ventormenta, te estaré esperando con los demás.\n\nY date prisa, $n. No es aconsejable hacer esperar al rey...', '', '', '', '', '', '', 33528),
(58673, 'esES', 'Jefe de Guerra de la Horda', 'Presencia la reunión de campeones.', 'La reunión para decidir el próximo jefe de guerra de la Horda está a punto de empezar.\n\nLos demás líderes de la Horda ya han llegado y te esperan en la embajada.\n\nVen a verme cuando estés $glisto:lista;, e iremos a saludar a los demás.', '', '', '', '', '', '', 33528),
(58672, 'esES', 'Una reunión de campeones', 'Habla con Valeera Sanguinar en Orgrimmar.', 'Los líderes de la Horda se reúnen en Orgrimmar para designar a un nuevo jefe de guerra de la Horda.\n\nComo $gcampeón:campeona; de la Horda, se ha solicitado tu presencia en la reunión, que se celebrará en la Embajada de Orgrimmar.\n\nYo voy a partir ya. Ven a verme cuando llegues a Orgrimmar, estaré esperando con los demás.\n\nDate prisa, $gcampeón:campeona;. El futuro de la Horda está por decidir...', '', '', '', '', '', '', 33528),
(58662, 'esES', 'Terrores cavadores', '', '', '', '', '', '', '', '', 33528),
(58661, 'esES', 'Terrores cavadores', '', '', '', '', '', '', '', '', 33528),
(58660, 'esES', 'Terrores cavadores', '', '', '', '', '', '', '', '', 33528),
(58646, 'esES', '¡Cómete esto!', 'Mata a $1oa corredunas carroñeros en Uldum.', 'Esas hienas sarnosas roen cuanto desentierran, ¡aunque sean artefactos valiosos!\n\nNo podemos permitir que la historia de Uldum acabe de una forma tan perra, por así decirlo.\n\nMe temo que vamos a tener que reducir su número.', '', '', '', '', '', '', 33528),
(58645, 'esES', 'Un mundo digno de salvar', 'Evita que los amathet se apoderen de las Cámaras de los Orígenes.', 'No hemos podido con ellos. Sus guerreros... envueltos en las llamas del sol...\n\nQuieren la forja... para acabar con todo...\n\nVe... Yo... resistiré...', '', '', '', '', '', '', 33528),
(58643, 'esES', 'Destrucción mutua asegurada', 'Avisa a los defensores de las Cámaras de los Orígenes acerca del plan de los amathet.', 'Los amathet quieren recuperar la Forja de los Orígenes y usarla para acabar con toda la vida en Azeroth, haya dioses antiguos de por medio o no.\n\nPodrían atacar en cualquier momento. ¡Tenemos que alertar a los defensores de la forja!', '', '', '', '', '', '', 33528),
(58642, 'esES', 'Objetivos compartidos', 'Defiende a la alta expedicionaria Dellorah mientras descifra las tablillas amathet que hay en la Cámara de las Estrellas.', 'El decreto que encontraste mencionaba un plan para derrotar a los dioses antiguos.\n\nSé que es poco probable que los amathet colaboren con nosotros para tal fin, pero si tienen un plan para eliminar a N\'Zoth, vale la pena echarle un vistazo.\n\nEl decreto menciona el motor de ascensión. Creo que así es como podrían llamar a ese dispositivo de potenciación solar que vimos antes. ¡Deberíamos echar un vistazo ahí debajo y ver si entendemos lo que planean!', '', '', '', '', '', '', 33528),
(58641, 'esES', 'Buscadores de corrupción', 'Consigue el decreto del Rey del Sol en poder de los amathet fúlgidos de Uldum.', 'Si alguien puede saber más acerca de la \"corrupción\" de la que hablaba la tablilla, son los fúlgidos a los que se encargó erradicarla.\n\nClaro que dudo que se presten a compartir esa información.\n\nPor suerte para mí, tú eres especialista en investigar a lo bruto, ¿verdad?', '', '', '', '', '', '', 33528),
(58640, 'esES', 'Una rendija en la armadura', 'Defiende a la alta expedicionaria Dellorah mientras descifra el monumento amathet frente a las Cámaras de los Orígenes.', 'Los artefactos que ayudaste a desenterrar muestran a los amathet como una tribu que se enorgullecía de proteger las obras de los titanes.\n\nEsto confirma nuestras suposiciones, e indica que algo drástico debió de pasarles para que dañaran las obras que juraron proteger.\n\nDeberíamos seguir buscando sus escritos. Creo que vi un monumento más reciente frente a las Cámaras de los Orígenes.', '', '', '', '', '', '', 33528),
(58639, 'esES', 'Historia enterrada', 'Descubre y reúne $1oa artefactos amathet en Uldum.', 'Dado que los amathet provienen de esta región, es lógico pensar que aquí queden artefactos de su civilización, ocultos bajo las arenas.\n\n¡Parece que toca excavar a la vieja usanza!\n\nLas dunas cercanas deben de haber cubierto una gran franja del antiguo territorio amathet. ¡A ver qué desenterramos por allí!', '', '', '', '', '', '', 33528),
(58638, 'esES', 'Una incursión más profunda', 'Defiende a la alta expedicionaria Dellorah mientras descifra el monumento amathet del Bancal Piedrasol.', 'Algo no cuadra con los amathet estos. ¿Por qué iban los protectores de las obras de los titanes a atacar y dañar la Forja de los Orígenes?\n\nCreo que esto tenemos que estudiarlo mejor. En ese bancal de allí me ha parecido ver un monumento. Tal vez lo que haya escrito en él nos revele algo más sobre esos tol\'vir.', '', '', '', '', '', '', 33528),
(58636, 'esES', 'Atención a los amathet', 'Explora los territorios amathet con la alta expedicionaria Dellorah en Uldum.', 'En nombre de la Liga de Expedicionarios, me gustaría darte las gracias por ayudar a consolidar el Acuerdo de Uldum y conseguirnos la cooperación de Ramkahen.\n\nCon el fin de entender mejor a nuestros enemigos, Ramkahen ha permitido explorar las tumbas amathet. Por desgracia, sus fuerzas están demasiado dispersas como para ofrecerles protección.\n\nEsperaba que tú nos ayudaras con eso.\n\n¿Crees que podrías dedicar algún tiempo a ver cómo están? Podemos empezar por una vista aérea.', '', '', '', '', '', '', 33528),
(58634, 'esES', 'Abrir el portal', 'Habla con MADRE para establecer el portal tenebroso en la Cámara del Corazón.', 'El tejido de la realidad está desgarrado. Pero eso no hace falta decírtelo, $n. Lo has visto en persona.\n\nSolo es cuestión de tiempo que esas realidades se conviertan en una sola, envuelta en una oscuridad eterna. En vez de escondernos, tal vez sea hora de abrazar la oscuridad.\n\nCon la ayuda de nuestro amigo titánico, podríamos enhebrar la aguja de esta realidad en el tejido de otra, para así crear una especie de puente.\n\nAl fin y al cabo, la clave para averiguar los puntos débiles de un enemigo radica en entender sus intenciones.', '', '', '', '', '', '', 33528),
(58632, 'esES', 'Ny\'alotha, Ciudad del Despertar: El fin del Corruptor', 'Derrota a N\'Zoth en Ny\'alotha, Ciudad del Despertar.', 'Gracias a los estudios de los mogu, MADRE y Ra Den hallaron un modo de concentrar el Protocolo de los Orígenes de la forja a través de la Cámara del Corazón. El problema era averiguar dónde dispararlo.\n\nHasta ahora, claro.\n\nToma estos anclajes y cruza ese portal. Tendrás que encontrar puntos destacados en los que situarlos para poder enfocar el arma. Una vez colocados, estaremos listos para disparar.\n\nSolo dispondrás de un tiro. ¡No lo desperdicies!', '', '', '', '', '', '', 33528),
(58631, 'esES', 'En sueños', 'Habla con MADRE en la Cámara del Corazón para averiguar el paradero de Ra Den.', 'No puedo creer que Ra Den se haya sacrificado para salvarnos. ¡No podemos abandonarlo!\n\nTiene que haber algún modo de averiguar adónde ha ido.\n\n¡A ver si MADRE puede localizarlo!', '', '', '', '', '', '', 33528),
(58615, 'esES', 'Susurros en la oscuridad', 'Busca el origen de los susurros de N\'Zoth en la Cámara del Corazón.', '¿Tú también lo has oído? Eso no puede ser bueno.\n\n¡Como N\'Zoth acceda a esta cámara, estamos todos perdidos!\n\n¡Tenemos que averiguar por dónde va a entrar en la cámara y bloquearlo, antes de que haga algo más que susurrarnos!', '', '', '', '', '', '', 33528),
(58606, 'esES', 'Un trozo de investigación', 'Consigue $1oa trozos de aqir.', '¡$p, este puede ser el descubrimiento del siglo!\n\nAún no puedo afirmarlo con total certeza, pero me da que a estos insectos se los conoce como los aqir.\n\nLa Liga apenas tiene registros intactos, pero la última mención de estas criaturas describe una gran guerra entre los C\'Thraxxi, los aqir y las primeras civilizaciones trols.\n\nCreíamos que los llevaron a la extinción, pero puede que simplemente hayan estado... restableciéndose.\n\n¿Podrías traerme algunas muestras para examinarlas?', '', '', '', '', '', '', 33528),
(58595, 'esES', 'Pilares del olvido', 'Destruye $1oa obeliscos del Imperio Negro en el Valle de la Flor Eterna.', 'En épocas pasadas, los obeliscos negros de los dioses antiguos presagiaban la llegada de sus fuerzas. Los conjuradores oscuros de los k\'thir y los N\'raqi usaban estos monumentos para establecer posiciones en nuestro mundo y abrir el paso a nuevos esbirros de los dioses antiguos.\n\nHoy vemos los campos de batalla llenos de esos mismos obeliscos. Mientras sigan ahí, las fuerzas de N\'Zoth no tendrán fin.\n\nAsegúrate de que no sea así.', '', '', '', '', '', '', 33528),
(58583, 'esES', 'Donde está el corazón', 'Reúnete con Magni Barbabronce en la Cámara del Corazón.', 'El Portavoz ha solicitado que te envíe a echarle una mano a él y a Wrathion.\n\nHas demostrado ser $gun:una; gran $galiado:aliada; para Azeroth, y sospecho que desempeñarás un importante papel en las batallas venideras.\n\nEsperemos que el resto de la Horda y la Alianza puedan dejar a un lado sus diferencias para enfrentarse a un enemigo común.', '', '', '', '', '', '', 33528),
(58582, 'esES', 'El regreso del Príncipe Negro', 'Habla con Valeera Sanguinar en el Gran Sello, en Dazar\'alor.', 'Acabo de volver de una reunión con el rey Wrynn en Ventormenta.\n\nTenemos muchos asuntos que tratar.\n\nReúnete enseguida conmigo en el Gran Sello.', '', '', '', '', '', '', 33528),
(58506, 'esES', 'Diagnóstico de red', 'Activa las consolas titánicas de la Cámara del Corazón para comprobar el estado de las forjas titánicas en todo Azeroth.', 'Por desgracia, no tenemos ni idea de dónde ha estado acechando N\'Zoth desde que se escapó. Pero algo sí sabemos sobre dónde podría atacar.\n\nCuando los guardianes encerraron a los dioses antiguos, construyeron en las forjas titánicas mecanismos de defensa contra su corrupción. Si N\'Zoth quiere corromper Azeroth, antes tendrá que superarlos.\n\nPor suerte ahora estamos conectados con ellos, de modo que podemos vigilarlos desde aquí. Ve a echar un vistazo.', '', '', '', '', '', '', 33528),
(58502, 'esES', 'Donde está el corazón', 'Vuelve a la Cámara del Corazón.', 'Es hora de poner en marcha los planes de Wrathion.\n\nÉl volverá a la Cámara del Corazón, así que deberíamos reunirnos allí con él.', '', '', '', '', '', '', 33528),
(58498, 'esES', 'El regreso del rey guerrero', 'Ve con Anduin y recupera la maza Domamiedo en el Castillo de Ventormenta.', 'Has hecho mucho por Azeroth, adalid, pero por desgracia voy a tener que pedirte que hagas más. N\'Zoth anda suelto, y es imposible saber cuándo o dónde atacará.\n\nEsta batalla no puedes librarla tú $gsolo:sola;. ¡Cuando llegue el momento, tendrás mi martillo a tu lado!\n\nPero antes tendremos que hacernos con él.', '', '', '', '', '', '', 33528),
(58496, 'esES', 'Un consejero poco grato', 'Habla con el rey Anduin Wrynn en el Castillo de Ventormenta.', 'Ni siquiera mediante la colaboración de la Horda y la Alianza hemos sido capaces de localizar las tropas de N\'Zoth. Desde su liberación, el dios antiguo siempre nos ha dado esquinazo.\n\nSolo la Luz sabe qué maldades planea para Azeroth.\n\nReúnete conmigo en el Castillo de Ventormenta. ¡Debemos elaborar un plan que desvele las maquinaciones de N\'Zoth antes de que sea tarde!', '', '', '', '', '', '', 33528),
(58487, 'esES', 'Desvalijadores desvalijados', 'Despoja $1oa botines mogu en el Valle de la Flor Eterna.', 'Nuestros asaltos a los tesoros de Lei Shen ayudaron en gran parte a la caída del Rey del Trueno. Creo que aquí deberíamos emplear la misma estrategia.\n\nBusca el botín acumulado por los clanes mogu y arrebátaselo.\n\nDebemos hacer todo lo posible para entorpecer su avance.', '', '', '', '', '', '', 33528),
(58485, 'esES', 'Hechas para caer', 'Destruye $1oa estatuas mogu en el Valle de la Flor Eterna.', 'Los baruk usan las artes prohibidas de la nigromancia para atrapar las almas de los mogu caídos y encerrarlas en estatuas que luego luchan por ellos.\n\nEsas tácticas son deshonrosas para nuestro pueblo y no podemos permitir que continúen.\n\nRompe sus preciadas estatuas y déjalos sin receptáculos con los que contaminar los espíritus que roban.', '', '', '', '', '', '', 33528),
(58481, 'esES', 'Rituales de sangre', 'Destruye $1oa fuentes de sangre en el Valle de la Flor Eterna.', 'Anji y yo hemos luchado en muchas batallas, así que sabemos cómo tratar con unos cuantos mogu, ¡pero la magia de sangre que usan esos dokani resulta perturbadora!\n\nPor si no les bastara con matar a todo aquel que se les cruza, encima usan sus cadáveres para sus rituales impíos. ¡Eso me sobrepasa!\n\nHazme un favor. Si te topas con alguno de esos rituales, ¡detenlo! Ni siquiera nuestros enemigos merecen ser profanados por su magia oscura.', '', '', '', '', '', '', 33528),
(58479, 'esES', 'Colisiones de relámpagos', 'Destruye $1oa pararrayos en el Valle de la Flor Eterna.', 'Los Zan-Tien afirman dominar el poder de las tormentas, pero recurren a máquinas para usar los relámpagos del cielo.\n\nDemuestra a esos farsantes que el auténtico poder de la tormenta y el trueno procede del interior. Rompe sus juguetes y a ver cómo les va sin ellos.', '', '', '', '', '', '', 33528),
(58478, 'esES', 'Remover cielo y piedra', 'Mata a $1oa mogu baruk en el Valle de la Flor Eterna.', 'Cuando los clanes enfrentados llegaron al valle, los baruk se consideraron dignos de reclamar las tierras ancestrales de Guo-Lai.\n\nPero no lo son.\n\nEnseña a esos usurpadores cuál es su lugar, y tal vez te ganes algo del favor de los rajani.', '', '', '', '', '', '', 33528),
(58477, 'esES', 'Sangre, polvo y hueso', 'Reúne $1oa glóbulos de ánima de los mogu dokani y de sus aliados, que están en el Valle de la Flor Eterna.', 'Los dokani se creen aptos para blandir la magia antigua de ánima, pero sus gólems y manifestaciones no son sino una fracción del auténtico poder de ánima.\n\nLibéralos de su preciada sustancia para que los rajani puedan darle mejor uso.', '', '', '', '', '', '', 33528),
(58471, 'esES', 'Anotación agresiva', 'Usa el cuaderno del eremita para tomar notas sobre los ignotos, los k\'thir y las bestias de carne que hay en el Valle de la Flor Eterna.', 'A pesar de los orígenes comunes de los sha y los dioses antiguos, en Pandaria no sabemos gran cosa sobre ellos.\n\nQuerría aprovechar esta oportunidad para añadir a los archivos de los eremitas toda la información posible sobre el tema. Claro que no resulta fácil, cuando tratan de matarnos.\n\nPara ti, sin embargo, no parece demasiado problemático. ¿Podrías hacerme un favor y tomar algunas notas de lo que encuentres? Serían de gran ayuda para entender a qué nos enfrentamos.', '', '', '', '', '', '', 33528),
(58470, 'esES', 'Curiosidades corruptas', 'Reúne $1oa artefactos del Imperio Negro de alijos del Imperio Negro en el Valle de la Flor Eterna.', 'Entiendo que el Imperio Negro supone una grave amenaza para Pandaria, ¡pero esto puede ser también una oportunidad!\n\nAunque nos hemos enfrentado varias veces a ellos, poco se sabe sobre los dioses antiguos o sobre el misterioso reino de N\'Zoth, Ny\'alotha.\n\nAl estudiar antiguas civilizaciones, solemos analizar sus artefactos para descubrir los mayores secretos perdidos en el tiempo. Me pregunto si no habrá artefactos así entre las tropas del dios antiguo.\n\nNo perdemos nada por comprobarlo, ¿no?', '', '', '', '', '', '', 33528),
(58469, 'esES', 'Lágrimas en el valle', 'Cierra $1oa desgarros del Vacío en el Valle de la Flor Eterna.', 'A medida que la influencia de N\'Zoth se extiende por el valle, nuestra realidad empieza a desintegrarse.\n\nEl poder del dios antiguo ha creado en el tejido de nuestro mundo unos desgarros por los que entran sus esbirros para invadirnos desde su reino oscuro.\n\nMientras existan esos desgarros, jamás nos libraremos de las garras de N\'Zoth. ¡Séllalos y contén la marea de su corrupción!', '', '', '', '', '', '', 33528),
(58468, 'esES', 'Oscuridad creciente', 'Destruye $1oa incubadoras corruptas en la Mina de la Gran Flor, que está en el Valle de la Flor Eterna.', 'Los exploradores del Shadopan han descubierto pruebas de un nuevo criadero mántide en la Mina de la Gran Flor. Por lo visto, esos mántides Colmenahonda pretenden crear nuevos engendros corruptos que sirvan a N\'Zoth.\n\nSi dejamos que esos huevos eclosionen, un nuevo enjambre potenciado por el dios antiguo podría oscurecer el cielo del valle y sumir Pandaria en las tinieblas.\n\nPero no lo permitiremos, ¿verdad?', '', '', '', '', '', '', 33528),
(58467, 'esES', 'Prisioneros de cuerpo y mente', 'Rescata a $1oa pandaren cautivos en el Valle de la Flor Eterna.', 'Las tropas de N\'Zoth atacaron el valle de repente. Para cuando llegamos el Shadopan y yo, las tropas del dios antiguo ya habían hecho prisioneros a muchos miembros del Loto Dorado.\n\nIncluso combinando nuestro poder, tan solo hemos conseguido impedir que capturasen a más de los nuestros. Los que se llevaron antes, sin embargo, permanecen cautivos bajo las garras del dios antiguo.\n\nSé que hemos tenido nuestras diferencias, $n, pero si pudieras ayudarnos a recuperarlos, el Shadopan estaría en deuda contigo.', '', '', '', '', '', '', 33528),
(58466, 'esES', 'Tormento del más allá', 'Libera a $1oa espíritus pandaren ancianos en el Valle de la Flor Eterna.', 'Como si no fuera ya bastante terrible que N\'Zoth quiera dominar a todo ser vivo del valle, mis exploradores me informan de que ahora ¡pretende dominar también a los muertos!\n\nEl Shadopan no puede abandonar la defensa de los vivos. ¿Podemos contar contigo para poner fin a esta ignominia?', '', '', '', '', '', '', 33528),
(58465, 'esES', 'Corrupción manifiesta', 'Mata a $1oa icores pútridos en el Valle de la Flor Eterna.', 'La corrupción de los dioses antiguos suele ser tan nauseabunda que se manifiesta en forma física.\n\nYa lo comprobamos con los sha, y esta vez no es diferente.\n\nElimina la corrupción dondequiera que la veas propagarse. No debemos permitir que crezca.', '', '', '', '', '', '', 33528),
(58464, 'esES', 'Exterminio de los Colmenahonda', 'Mata a $1oa mántides Colmenahonda en la Mina de la Gran Flor, que está en el Valle de la Flor Eterna.', 'Una secta del enjambre mántide que se hace llamar \"Colmenahonda\" se ha apoderado de la Mina de la Gran Flor. Estos mántides se han entregado por completo a la corrupción de los dioses antiguos, lo que los hace especialmente peligrosos.\n\nNo podemos dejar que los Colmenahonda causen estragos en el valle. Haz lo que tengas que hacer.', '', '', '', '', '', '', 33528),
(58463, 'esES', 'Engendros de locura', 'Mata $1oa bestias de carne en el Valle de la Flor Eterna.', 'Me hierve la sangre solo de pensar que he sido testigo de la recuperación y la vuelta al esplendor del Valle de la Flor Eterna tras la agresión de los sha, para ahora volver a verlo mancillado por los dioses antiguos.\n\nDebemos erradicar la corrupción de los dioses antiguos antes de que vuelva a apoderarse de esta tierra. He visto que las bestias de carne que acompañan a las tropas de N\'Zoth propagan la corrupción a su paso.\n\nAsegúrate de que no den ni un paso más.', '', '', '', '', '', '', 33528),
(58462, 'esES', 'Ventanas del alma', 'Mata a $1oa ojos del imperio en el Valle de la Flor Eterna.', 'Como si la fuerza letal de nuestro enemigo no fuera suficiente, además sus esbirros atacan al corazón mismo de nuestros defensores.\n\nMe refiero, claro está, a los ojos. Se asoman a las almas de nuestros guerreros y utilizan sus miedos más profundos contra ellos.\n\nSi queremos tener alguna esperanza de vencer a este enemigo, debemos acabar con ellos.', '', '', '', '', '', '', 33528),
(58461, 'esES', 'Escritos de locura antigua', 'Consigue $1oa escritos de locura antigua de los enemigos k\'thir que hay en el Valle de la Flor Eterna.', 'En momentos como este, es necesario que todos los habitantes del valle colaboren en lo que puedan. Por desgracia, yo nunca he sido un gran luchador, así que mi utilidad en época de guerra es limitada.\n\nNo obstante, tal vez pueda contribuir. Verás, sabemos muy poco de los invasores a los que nos enfrentamos, y la información puede ser un arma muy poderosa.\n\nMe pareció ver que algunos de los k\'thir llevaban escritos. Si consigues traerme algunos, quizás podría deducir algo útil de ellos.', '', '', '', '', '', '', 33528),
(58460, 'esES', 'Mariscales de la locura', 'Mata a $1oa esbirros ignotos de N\'Zoth en el Valle de la Flor Eterna.', 'Los N\'raqi llevan mucho tiempo sirviendo como comandantes y capataces en las tropas de los dioses antiguos. Su presencia en el campo de batalla demuestra que esta invasión sigue un plan coordinado, y no es un mero brote improvisado de corrupción.\n\nBajo el mando de esos maestros ignotos, las caóticas tropas de los dioses antiguos se transforman en un cuerpo militar competente.\n\nNuestra prioridad debe ser abatir a estas criaturas. Solo así, podremos tomarle ventaja a N\'Zoth.', '', '', '', '', '', '', 33528),
(58458, 'esES', 'Desafío de duelo de mascotas: Profundidades de Roca Negra', 'Detén a las figuras enigmáticas.', 'Ya están otra vez esas figuras enigmáticas haciendo de las suyas, ¿seguro que quieres enfrentarte a ellas? Si de verdad quieres volver ahí dentro, por mí adelante.', '', '', '', '', '', '', 33528),
(58457, 'esES', 'Sombras de Roca Negra', 'Detén a las figuras enigmáticas.', 'Por fin hemos localizado a esas molestas figuras enigmáticas, deberían estar todas ahí dentro. Parecen muy hábiles; más vale que te lleves a tus mejores equipos si quieres tener alguna posibilidad de ganar.\n\nAvísame cuando estés $glisto:lista;.', '', '', '', '', '', '', 33528),
(58456, 'esES', 'Duelo enigmático', 'Encuentra a Burt Macklyn frente a la entrada de las Profundidades de Roca Negra, que está en la Montaña Roca Negra.', '¡Esta es la nuestra! Hemos descubierto dónde se escondían esas figuras enigmáticas, y es hora de lanzar nuestro ataque para frustrar sus planes, sean los que sean. Su base de operaciones se halla en las Profundidades de Roca Negra. Ahora todo depende de ti.', '', '', '', '', '', '', 33528),
(58455, 'esES', 'Duelo enigmático', 'Encuentra a Burt Macklyn frente a la entrada de las Profundidades de Roca Negra, que está en la Montaña Roca Negra.', '¡Esta es la nuestra! Hemos descubierto dónde se escondían esas figuras enigmáticas, y es hora de lanzar nuestro ataque para frustrar sus planes, sean los que sean. Su base de operaciones se halla en las Profundidades de Roca Negra. Ahora todo depende de ti.', '', '', '', '', '', '', 33528),
(58442, 'esES', 'Fauces acuciantes', '', '', '', '', '', '', '', '', 33528),
(58439, 'esES', 'Fauces acuciantes', '', '', '', '', '', '', '', '', 33528),
(58438, 'esES', 'Fauces acuciantes', '', '', '', '', '', '', '', '', 33528),
(58436, 'esES', 'Legado de los mecagnomos', 'Reúnete con el príncipe Erazmin en la Ciudad de Mecandria.', '$n, no podríamos estar más satisfechos con tus progresos. Nos representas bien en la Alianza.\n\nRegresa a la Ciudad de Mecandria en cuanto te sea posible. Waren te ha preparado un regalo.', '', '', '', '', '', '', 33528),
(58435, 'esES', 'Legado de los vulperas', 'Reúnete con Hagashi en el Escondrijo Vulpera, que está en Vol\'dun.', 'La Horda ha acabado valorando a los vulperas, gracias a ti.\n\nEres $gel:la; vulpera más... vulpera que conozco.\n\nVen a visitarme al Escondrijo Vulpera, que está en Vol\'dun. Kiro me pidió que te preparara un pequeño recuerdo a modo de agradecimiento.', '', '', '', '', '', '', 33528),
(58423, 'esES', 'Los más fuertes de todos', 'Derrota a 3 esbirros de N\'Zoth poco comunes en el Valle de la Flor Eterna.', 'Has demostrado una gran fuerza en tus conquistas, pero el valle sufre nuevos ataques cada día.\n\nLocaliza a los más fuertes entre las tropas del enemigo y abátelos para que sus aliados lo vean.', '', '', '', '', '', '', 33528),
(58422, 'esES', 'Marca de los conquistadores', 'Quema $1oa estandartes del Imperio Negro en el Valle de la Flor Eterna.', 'Los esbirros de N\'Zoth invaden tierras a las que no tienen derecho.\n\nNadie conquistará el valle mientras a un solo rajani le quede aliento.\n\nQuema sus estandartes para que no lo olviden.', '', '', '', '', '', '', 33528),
(58420, 'esES', 'Un incordio horroroso', 'Mata a $1oa hozen Colamar en el Valle de la Flor Eterna.', 'Los hozen son oportunistas y débiles. No me sorprende que algunos se hayan aliado con los dioses antiguos.\n\nDeberíamos encargarnos de ellos antes de que se conviertan en algo peor que un mero incordio.', '', '', '', '', '', '', 33528),
(58375, 'esES', 'Ny\'alotha: Indicaciones de MADRE', 'Consigue 4 núcleos de titán de Ra Den, 4 corazones de dragón de Vexiona y 4 ojos proféticos de Il\'gynoth en Ny\'alotha, Ciudad del Despertar, en dificultad mítica.', 'Ny\'alotha no sigue las reglas del espacio y el tiempo, algo que tal vez podríamos aprovechar.\n\nMADRE sostiene que, si conseguimos objetos específicos de los elegidos de N\'Zoth, podemos usarlos para curvar el espacio y acelerar nuestra llegada aquí en el futuro. Eso sí, dudo que se desprendan de esos objetos de buena gana.', '', '', '', '', '', '', 33528),
(58374, 'esES', 'Ny\'alotha: Indicaciones de MADRE', 'Consigue 4 núcleos de titán de Ra Den, 4 corazones de dragón de Vexiona y 4 ojos proféticos de Il\'gynoth en Ny\'alotha, Ciudad del Despertar, en dificultad heroica.', 'Ny\'alotha no sigue las reglas del espacio y el tiempo, algo que tal vez podríamos aprovechar.\n\nMADRE sostiene que, si conseguimos objetos específicos de los elegidos de N\'Zoth, podemos usarlos para curvar el espacio y acelerar nuestra llegada aquí en el futuro. Eso sí, dudo que se desprendan de esos objetos de buena gana.', '', '', '', '', '', '', 33528),
(58373, 'esES', 'Ny\'alotha: Indicaciones de MADRE', 'Consigue 4 núcleos de titán de Ra Den, 4 corazones de dragón de Vexiona y 4 ojos proféticos de Il\'gynoth en Ny\'alotha, Ciudad del Despertar, en dificultad normal.', 'Ny\'alotha no sigue las reglas del espacio y el tiempo, algo que tal vez podríamos aprovechar.\n\nMADRE sostiene que, si conseguimos objetos específicos de los elegidos de N\'Zoth, podemos usarlos para curvar el espacio y acelerar nuestra llegada aquí en el futuro. Eso sí, dudo que se desprendan de esos objetos de buena gana.', '', '', '', '', '', '', 33528),
