(58334, 'esES', 'Bruma Otoñal en llamas', '', '', '', '', '', '', '', '', 33528),
(58321, 'esES', 'Núcleo inusual', 'Consigue un núcleo titánico de un vigía de marfil en Uldum.', 'Nuestros exploradores nos han informado de que los amathet están construyendo nuevos vigías titánicos.\n\nCreíamos que este arte se había perdido para siempre en las arenas del tiempo. Por lo visto nos equivocábamos.\n\nNo hace falta que te diga que sería una bendición contar con la ayuda de ensamblajes vigías en nuestras batallas por Uldum. ¡Debemos desbloquear los secretos de su construcción!\n\nEl poder de un vigía titánico reside en su núcleo. Tráeme uno para que nuestros artificieros puedan descubrir cómo está construido.', '', '', '', '', '', '', 33528),
(58318, 'esES', 'Máscara ignota de la noche larga', 'Devuelve la máscara ignota de la noche larga al altar en una visión horripilante.', 'La resistencia necesaria para llegar hasta aquí es extraordinaria, una hazaña propia de un aventurero de amplia experiencia. Aun así, se acerca la noche más larga, y con ella nuestra conquista definitiva. Quienes se oponen a la llegada del crepúsculo eterno no conocen sino la futilidad, pues en la noche más larga permanecerán para siempre al límite de la locura.', '', '', '', '', '', '', 33528),
(58317, 'esES', 'Máscara ignota del dolor', 'Devuelve la máscara ignota del dolor al altar en una visión horripilante.', 'Traficar con secretos y mentiras, y operar en los márgenes, eso es lo único que conoce el maestro de espías. Sus pasiones pasadas, sus amores perdidos, todo desaparece bajo el peso de su deber y lealtad a la corona. No queda nada, nada salvo el dolor. El dolor es un maestro y un instrumento eficaz que el Vacío conoce bien. Devuelve mi máscara si te atreves a sentir las muchas formas que el dolor puede adoptar.', '', '', '', '', '', '', 33528),
(58316, 'esES', 'Máscara ignota de la imaginación oscura', 'Devuelve la máscara ignota de la imaginación oscura al altar en una visión horripilante.', 'Los magi retuercen su magia para manipular y conquistar el mundo. Imaginan un poder superior y, para obtenerlo, caminan por los dominios del Vacío. En su búsqueda, este descubrió que en las profundidades de la propia imaginación anidan la oscuridad y el terror.', '', '', '', '', '', '', 33528),
(58314, 'esES', 'Máscara ignota del puente quemado', 'Devuelve la máscara ignota del puente quemado al altar en una visión horripilante.', 'El guerrero desplazado está siempre inquieto, sobre todo cuando no está en su mundo natal. El Vacío hace de esta inseguridad una realidad en la que un paso en falso puede conducirte al abismo o dejarte seco.', '', '', '', '', '', '', 33528),
(58297, 'esES', 'Máscara ignota del temerario', 'Devuelve la máscara ignota del temerario al altar en una visión horripilante.', 'El cazador nunca buscó el liderazgo, pero sí el desafío constante en su vida. Dirigió a sus aliados con maestría y nunca evitó el cuerpo a cuerpo. La destreza que demostraba hizo que tanto él como mis demás esbirros fueran mucho más letales. Devuelve esta máscara al altar del temerario para poner a prueba tu propia determinación en combate cuando los ataques de tus enemigos resulten aún más mortíferos.', '', '', '', '', '', '', 33528),
(58291, 'esES', 'Furtivos invasores', 'Consigue $1oa pelambres de hienas tupidas de los cazadores amathet o despellejando hienas en Uldum.', 'Los Vagayermos usábamos las pelambres de las hienas de la zona para fabricar nuestra armadura. Por desgracia, desde que llegaron los amathet, sus cazadores han invadido nuestros terrenos de caza habituales.\n\nNecesitamos esas pelambres, y pagaremos generosamente por ellas. Arrebátaselas a los cazadores o desuella tú $gmismo:misma; a las hienas, si tienes esa habilidad.', '', '', '', '', '', '', 33528),
(58290, 'esES', 'Campeones de los amathet', 'Mata a $1oa enemigos amathet de élite en Uldum.', 'Los soldados de Ramkahen son robustos y solventes.\n\nPueden enfrentarse sin problemas a cualquier lacayo de los amathet, pero sus luchadores de casta superior son demasiado incluso para nuestros soldados más duros.\n\nSin embargo, a ti no creo que te supusieran un problema. Sería una bendición para nuestras defensas que pudieras encargarte de ellos mientras mis tropas se las ven con los soldados rasos.', '', '', '', '', '', '', 33528),
(58289, 'esES', 'Secretos protegidos', 'Saquea $1oa alijos amathet en Uldum.', 'Por lo que sabemos sobre los amathet, deben de haber estado encerrados en sus tumbas durante miles de años. ¡Piensa en lo que podríamos aprender de ellos!\n\nClaro que sería mucho más fácil si no estuvieran intentando matarnos.\n\nSi te encuentras algún alijo de reliquias amathet en tus viajes, avísame. Me encantaría ver qué tipo de misterios albergan.', '', '', '', '', '', '', 33528),
(58288, 'esES', 'Los elegidos del Rey del Sol', 'Derrota a 3 enemigos amathet poco comunes en Uldum.', 'A primera vista los amathet parecen inquebrantables, pero todo soldado tiene un punto límite. Debemos hacer ver a sus tropas que con nosotros no se juega.\n\nBusca a sus integrantes más fuertes y liquídalos ante sus ojos.\n\n¡Les demostraremos la fuerza de Uldum!', '', '', '', '', '', '', 33528),
(58287, 'esES', 'Un plan de impacto', 'Destruye $1oa ídolos amathet y $2oa obeliscos fúlgidos en Uldum.', 'Los informes de mis exploradores mencionan varios ídolos y monumentos que los amathet usan para canalizar su magia solar.\n\nNo sé exactamente qué se proponen, pero deberíamos despojarlos de cualquier ventaja que puedan tener. Así que quiero que vayas allí y destruyas todo lo que te parezca remotamente mágico.\n\nPero no se lo digas a la Liga de Expedicionarios. No me lo perdonarían jamás.', '', '', '', '', '', '', 33528),
(58286, 'esES', 'Lejos de casa', 'Libera a $1oa tol\'vir esclavizados en Uldum.', 'La conquista del este de Uldum por parte de los amathet fue repentina, y no nos dio tiempo a llegar a algunos de nuestros asentamientos más alejados.\n\nPor suerte, a muchos de los tol\'vir que vivían en los territorios conquistados no los mataron, sino que los pusieron a trabajar a golpe de látigo.\n\nDebemos aprovechar la menor oportunidad para liberarlos y llevarlos de nuevo a su hogar.', '', '', '', '', '', '', 33528),
(58285, 'esES', 'Artefactos desenterrados', 'Consigue $1oa artefactos titánicos en Uldum.', 'Desde que los amathet salieron de sus tumbas, han estado muy ocupados desenterrando reliquias titánicas de las zonas circundantes.\n\nNo tengo muy claro qué pretenden hacer con ellas, o si las acaparan solo para que no las tengamos nosotros, ¡lo que es evidente es que a la Liga de Expedicionarios le encantaría estudiar algunos de los artefactos que han encontrado!\n\nPero, claro, no podemos acercarnos siquiera sin que los amathet traten de molernos a hachazos, sin embargo eso para ti no es problema, ¿verdad?\n\n¿Te importaría ayudarnos?', '', '', '', '', '', '', 33528),
(58284, 'esES', 'Mandatos del Rey del Sol', 'Consigue $1oa mandatos del Rey del Sol en poder de los amathet fúlgidos de Uldum.', 'Apenas se sabe nada del Rey del Sol que lidera a los amathet. Por lo que hemos observado, parece que los más cercanos a él son los \"fúlgidos\", una exclusiva casta de practicantes de magia solar.\n\nMe encantaría saber más sobre el Rey del Sol, pero, al contrario que otros miembros de la Liga de Expedicionarios, no pienso arriesgar las vidas de mis investigadores para conseguirlo.\n\nTú, sin embargo, pareces capaz de defenderte. Si encuentras algún registro sobre el Rey del Sol, con mucho gusto lo aceptaría.', '', '', '', '', '', '', 33528),
(58283, 'esES', 'Ciegos guiando a ciegos', 'Mata a $1oa sacerdotes amathet en Uldum.', 'Los sacerdotes del sol son una antigua orden de los tol\'vir que ha existido en todas las tribus.\n\nPero los que siguen a los amathet han retorcido nuestras creencias y las han convertido en armas para justificar su cruzada contra Ramkahen. Sus soldados los siguen ciegamente sin hacer preguntas.\n\nHay que detenerlos.', '', '', '', '', '', '', 33528),
(58282, 'esES', 'Desde el cielo', 'Mata a $1oa arqueros amathet en Uldum.', 'Los arqueros de Ramkahen son muy hábiles, pero los arcos de los amathet cuentan con la ventaja de su alcance. Eso hace que nuestras incursiones en su territorio sean muy peligrosas.\n\nA ti se te da bien luchar tras las líneas enemigas. Si pudieras reducirlos en número, tal vez tendríamos la oportunidad de hacerlos retroceder por una vez.\n\n¿Nos ayudas?', '', '', '', '', '', '', 33528),
(58281, 'esES', 'Armamentos antiguos', 'Consigue $1oa piezas de armadura amathet de los tol\'vir amathet de Uldum.', 'Librar una guerra en varios frentes ha hecho mella en nuestros suministros. Los herreros no dan abasto a la hora de reparar y reemplazar las armaduras de nuestros soldados, lo que hace que no estemos bien equipados para enfrentarnos a tantos enemigos.\n\nAunque las armaduras amathet son muy antiguas, las forjaron los titanes y son formidables. Si consiguiéramos hacernos con alguna, nuestras defensas mejorarían considerablemente.\n\n¿Puedes ayudarnos?', '', '', '', '', '', '', 33528),
(58279, 'esES', 'El botín del intendente', '', '', '', '', '', '', '', '', 33528),
(58277, 'esES', 'Impostores oscuros', 'Mata a $1oa esbirros k\'thir en Uldum.', 'Los dioses antiguos cuentan con muchos esbirros ignotos, pero los más engañosos son los denominados k\'thir.\n\nAunque no tan imponentes como sus hermanos, los k\'thir manipulan en las sombras, doblegan las voluntades de los hombres e incluso la realidad misma.\n\nDebemos poner freno a sus maquinaciones.', '', '', '', '', '', '', 33528),
(58276, 'esES', 'Mar\'at en llamas', '', '', '', '', '', '', '', '', 33528),
(58275, 'esES', 'Invocación monstruosa', '', '', '', '', '', '', '', '', 33528),
(58274, 'esES', 'Sirviente de N\'Zoth', 'Usa N\'lyeth, Esquirla de N\'Zoth, para cambiar tu facción, y pasar de ser de la Alianza a ser $gdevoto:devota; de N\'Zoth. Después mata a 10 jugadores de la Alianza sin morir.', '$C...\n\nTe he observado... He sentido tu sed de sangre.\n\nPero sirves a falsos profetas... La Alianza es una ilusión... ¡Yo soy un dios!\n\nDemuéstrame que eres $gdigno:digna; de mi don... Mata a quienes quieren traicionarte...\n\n¡Mata... a la Alianza!', '', '', '', '', '', '', 33528),
(58273, 'esES', 'Sirviente de N\'Zoth', 'Usa N\'lyeth, Esquirla de N\'Zoth, para cambiar tu facción, y pasar de ser de la Horda a ser $gdevoto:devota; de N\'Zoth. Después mata a 10 jugadores de la Horda sin morir.', '$C...\n\nTe he observado... He sentido tu sed de sangre.\n\nPero sirves a falsos profetas... La Horda es una ilusión... ¡Yo soy un dios!\n\nDemuéstrame que eres $gdigno:digna; de mi don... Mata a quienes quieren traicionarte...\n\n¡Mata... a la Horda!', '', '', '', '', '', '', 33528),
(58271, 'esES', 'Ritual de llama del Vacío', '', '', '', '', '', '', '', '', 33528),
(58257, 'esES', 'Fauces acuciantes', '', '', '', '', '', '', '', '', 33528),
(58239, 'esES', 'Lecciones de saqueo', 'Saquea $1oa alijos del Imperio Negro en Uldum.', 'Los Vagayermos hemos sido bandoleros durante muchas generaciones, ya fuera en tierra o en el mar. Ahora hemos decidido dejar atrás esa vida para buscar una existencia más pacífica, pero no hemos olvidado lo aprendido en aquella época.\n\nUna de esas lecciones, que ahora me parece especialmente relevante, es que cuando te enfrentas a un oponente superior, suele ser útil emplear sus propias armas contra él.\n\nBusca sus alijos ocultos y hazte con todo lo que puedas. Quizá encuentres algo que cambie las tornas de esta batalla.', '', '', '', '', '', '', 33528),
(58238, 'esES', 'Perdidos y atormentados', 'Libera a $1oa ciudadanos Ramkahen de las celdas de tormento en la Ciudad Perdida de los Tol\'vir, que está en Uldum.', 'Nuestros ciudadanos de aquí de Ramkahen han logrado evitar lo peor del asalto de N\'Zoth.\n\nNuestros hermanos de la Ciudad Perdida no han tenido tanta suerte. Los que no murieron en el ataque, acabaron cautivos y presa de las torturas de los esbirros de N\'Zoth.\n\nSé que vas a enfrentarte a las tropas de N\'Zoth. Si además pudieras liberar a nuestros aliados, Ramkahen estaría en deuda contigo.', '', '', '', '', '', '', 33528),
(58237, 'esES', 'Purificar Uldum', 'Destruye $1oa tumores de corrupción en Uldum.', 'Cada segundo que las tropas de N\'Zoth permanecen en Uldum, la corrupción se filtra más en la tierra misma.\n\nAunque lográramos expulsar a sus esbirros, puede que el daño infligido a Uldum sea irreversible.\n\nDebemos buscar su corrupción allí donde se encone y eliminarla.', '', '', '', '', '', '', 33528),
(58236, 'esES', 'Destrucción simbólica', 'Destruye $1oa estandartes del Imperio Negro en Uldum.', 'Los cultores que siguen a esta legión oscura mancillan nuestras tierras con símbolos de los tiranos a los que obedecen.\n\nSus descerebrados seguidores avanzan en tropel hacia estos estandartes, y los adoran como a ídolos impíos.\n\nQuémalos y elimina su mácula de nuestras tierras.', '', '', '', '', '', '', 33528),
(58235, 'esES', 'Anclas del Imperio Negro', 'Destruye $1oa obeliscos del Imperio Negro en Uldum.', 'Esta invasión nos ha alcanzado sin previo aviso, las estructuras que recuerdan al Imperio Negro han aparecido de la nada, mientras desatan las fuerzas de los dioses antiguos. No tenemos ni idea de cómo se han generado ni de dónde provienen.\n\nPero siempre que aparece una estructura nueva, le preceden obeliscos maléficos. Creemos que esos obeliscos sirven de ancla para introducir más fuerzas de los dioses antiguos.\n\nSi de verdad queremos cambiar el curso de esta invasión, debemos destruir los obeliscos.', '', '', '', '', '', '', 33528),
(58234, 'esES', 'Fuente cuestionable', 'Consigue $1oa muestras de corrupción fusionada de las babosas de Uldum.', 'Mi clarividencia es una gran baza estratégica para la gente de Ramkahen. Sin embargo, últimamente la potencia de mis visiones me resulta agotadora.\n\nHe ideado un tónico para reducir el daño que me causan las visiones, pero necesitaré la esencia fusionada de la corrupción de los dioses antiguos.\n\nSi pudieras conseguirme algunas muestras, nos serían de gran utilidad en nuestra lucha.', '', '', '', '', '', '', 33528),
(58233, 'esES', 'Corruptores alterados', 'Mata a $1oa bestias de carne en Uldum.', 'Aunque las bestias de carne que acompañan a las tropas invasoras no parecen ser más que una molestia, disfrutan de una conexión profunda con los poderes corruptores de los dioses antiguos.\n\nComo una peste, propagan la corrupción de N\'Zoth allí donde van, y consiguen que la tierra misma se retuerza lentamente hasta adoptar su forma.\n\nHay que erradicarlas.', '', '', '', '', '', '', 33528),
(58232, 'esES', 'Orden entre el caos', 'Mata a $1oa esbirros ignotos de N\'Zoth en Uldum.', 'Ha pasado mucho tiempo desde que los tol\'vir se las vieron con las fuerzas de un dios antiguo, así que nuestros conocimientos tácticos de sus fuerzas son limitados.\n\nSin embargo, hay un principio del combate que siempre es válido: abatir a quien da las órdenes debilita al enemigo mucho más que abatir a los soldados rasos.\n\nHe observado que los esbirros ignotos más grandes actúan como comandantes de las tropas de los dioses antiguos. Siléncialos, y tal vez podamos sembrar un caos de distinta índole entre sus filas.', '', '', '', '', '', '', 33528),
(58231, 'esES', 'Sabiduría en la locura', 'Reúne $1oa escritos enajenados de cultores del Imperio Negro en Uldum.', 'En mis visiones oigo... voces...\n\nSus palabras no tienen sentido, pero con el tiempo surgen patrones. Creo que hay algo importante detrás de lo que dicen estas voces, pero aún no he conseguido descifrar una sola palabra.\n\nTendremos que acudir a las fuentes para comprender algo. Busca escritos entre los cultores que viajan con las criaturas oscuras. Sus divagaciones pueden ser la clave para descifrar el mensaje que encierra esta locura.', '', '', '', '', '', '', 33528),
(58230, 'esES', 'Cegar los ojos', 'Mata a $1oa observadores hediondos en los Campos de Akhenet, que están en Uldum.', 'Unas fuerzas extrañas han estado interfiriendo en mis visiones últimamente. Unos ojos siempre vigilantes perforan el velo y hacen añicos mi clarividencia.\n\nLos ojos de nuestro enemigo se asoman a nuestras propias almas y penetran en nuestra mente. Debemos arrancarlos si realmente queremos librar a esta tierra de la maldición.', '', '', '', '', '', '', 33528),
(58229, 'esES', 'Un berrido de convocación', 'Mata a 3 esbirros de N\'Zoth poco comunes en Uldum.', 'Nuestras tierras han sido infestadas por los esbirros de los dioses antiguos. Nos atacan en todos los frentes y acosan incluso las mentes de nuestros soldados.\n\nNuestras tropas no aguantarán mucho más tiempo. Debemos asestar un golpe decisivo para intentar subirles la moral.\n\nBusca las monstruosidades más grandes, más viscosas y con más tentáculos, y acaba con ellas. Mis hombres seguirán tu ejemplo.', '', '', '', '', '', '', 33528),
(58216, 'esES', 'Fauces acuciantes', '', '', '', '', '', '', '', '', 33528),
(58214, 'esES', 'Atención urgente', 'Encuentra a Kelsey Chispacero en el Puerto de Boralus.', 'Justo a tiempo, $n.\n\nKelsey Chispacero ha estado enviando mensajes a las capitales en busca de ayuda.\n\nEl estado de Mekkatorque es bastante grave y cada segundo cuenta.\n\nCorre al Puerto de Boralus, ella te estará esperando.', '', '', '', '', '', 'Encuentra a Kelsey Chispacero en el Puerto de Boralus.', 33528),
(58168, 'esES', 'Una realidad oscura y deslumbrante', 'Derrota a $1oa vigías Miradaoscura en la visión.', 'Sus ojos nos vigilan, $n, observan cada movimiento desde las sombras. No es de extrañar que nuestros esfuerzos hasta ahora hayan resultado... insuficientes.\n\nNo es en absoluto culpa tuya. Debimos haberlo sospechado hace mucho tiempo.\n\nSi queremos tener alguna posibilidad, debemos pasar desapercibidos.\n\nNuestro viejo amigo nos ha ofrecido un elixir que permite descubrir al enemigo. Aunque puede tener algunos... efectos secundarios, pero confiere a quien lo bebe visión real en la oscuridad.', '', '', '', '', '', '', 33528),
(58167, 'esES', 'Medidas preventivas', 'Destruye $1oa portales del Vacío en la visión.', 'Oleadas de oscuridad asaltan sin cesar las costas de nuestro mundo. Temo que las aguas a nuestros pies pronto nos inunden. Tal vez sea el momento de cambiar de enfoque.\n\nDirígete al reino retorcido y busca sus portales oscuros. Si logramos frenar su avance, podríamos ganar el tiempo necesario para descubrir un punto débil fatal.', '', '', '', '', '', '', 33528),
(58156, 'esES', 'Vencer a la oscuridad', 'Repele la corrupción de N\'Zoth en la visión.', 'La oscuridad crece. El ciclo continúa.\n\nHaz lo que puedas para frustrar los esfuerzos de N\'Zoth. Si no nos enfrentamos a la corrupción, puede que algún día nos veamos sumidos en la oscuridad.', '', '', '', '', '', '', 33528),
(58155, 'esES', 'Una ayuda en la oscuridad', 'Rescata a $1oa almas de la visión.', 'Imagina estar atrapado en un mundo que no sabías que existía; una realidad desconocida incluso para ti.\n\nPensamientos, miedos y deseos oscuros que enturbian la mente, además de una tentación irresistible.\n\nMuchos son los que sucumben a la oscuridad, incapaces de resistirse a estas tentaciones, pero no todos.\n\nHaz lo que puedas para proteger a quienes luchan contra la oscuridad. No debemos permitir que caigan.', '', '', '', '', '', '', 33528),
(58151, 'esES', 'Esbirros de N\'Zoth', 'Derrota a $1oa esbirros de N\'Zoth en la visión.', 'Los vientos aulladores que nos rodean podrían quedar algún día ahogados, ocultos tras estos susurros cada vez más oscuros y aun así familiares.\n\nHay que hacer algo.\n\nPenetra en la oscuridad, $n, y abate al enemigo.', '', '', '', '', '', '', 33528),
(58147, 'esES', 'En tierras extrañas', 'Encuentra el tablero de ¡Se busca héroe! de la Ciudad de Ventormenta.', '¡$gBienvenido:Bienvenida; a Ventormenta, $c! El rey Anduin Wrynn te invita a explorar nuestra hermosa ciudad. Tienes pinta de disfrutar de la vida nocturna. ¡Tenemos muchas tabernas populares y una escena musical de lo más animada! \n\nAh, pero eso puede esperar. Busca el tablero de ¡Se busca héroe! en la ciudad para averiguar dónde está la aventura, y luego habla con tu emisario.\n\nTe deseo una feliz estancia, $n. Ah, y un consejo: más vale que no intentes mejorar a la gente sin su consentimiento. ¡Algunos no se lo toman muy bien!', '', '', '', '', '', 'Habla con Lulana en el Distrito de los Enanos.', 33528),
(58146, 'esES', 'Por la Alianza', 'Reúnete con el embajador Moorgard en la Embajada de Ventormenta.', '¡Como manitas mayor y líder de gnomos y mecagnomos, es para mí un orgullo darte la bienvenida a la Alianza!\n\nUn mundo de aventura te espera más allá de las murallas de la Ciudad de Mecandria.\n\nCuando estés $glisto:lista;, ve al teletransporte. El embajador Moorgard estará esperando tu llegada en la Embajada de Ventormenta.\n\nDispondrás de muchas vías posibles para progresar.\n\nElige sabiamente, mejora y no olvides compartir tus datos.', '', '', '', '', '', 'Reúnete con el embajador Moorgard en la Embajada de Ventormenta.', 33528),
(58124, 'esES', 'En tierras extrañas', 'Busca el tablón de mando del jefe de guerra en Orgrimmar.', 'Saludos, soy el embajador Guardasombrío.\n\n<Guardasombrío echa un vistazo al papel que tiene en la mano>.\n\nEs un honor darte la bienvenida a Orgrimmar, $r.\n\n<Te mira, sonríe sin ganas y vuelve a mirar el papel>.\n\nAhora que una vida de aventuras se abre ante ti, te aseguro que... eh...\n\n¿Sabes qué? Llevo todo el día leyendo esto. Y estoy harto.\n\nExamina el tablón de mando del jefe de guerra para averiguar dónde puedes ir a buscar aventuras. Venga, largo.', '', '', '', '', '', 'Habla con Nilsa en el Valle del Honor.', 33528),
(58122, 'esES', 'Por la Horda', 'Reúnete con el embajador Guardasombrío en la Embajada de Orgrimmar.', '¡Menuda aventura, $c!\n\nHay tanto por explorar... Tanto por descubrir. ¡Son tiempos emocionantes!\n\nLes demostraremos a nuestros aliados de la Horda lo mucho que les conviene tener vulperas astutos cerca.\n\nReúnete con el embajador en la Embajada de Orgrimmar y busca aventuras por todo Azeroth y más allá.\n\n¡Hasta que nuestros caminos se vuelvan a cruzar, $n!', '', '', '', '', '', 'Reúnete con el embajador Guardasombrío en la Embajada de Orgrimmar.', 33528),
(58097, 'esES', 'Suministros del Acuerdo de Uldum', 'Habla con la proveedora Qorra en Uldum para obtener tu recompensa.', 'La Resistencia te agradece toda la ayuda que nos has prestado.\n\nAcepta estos suministros como muestra de nuestra gratitud, así como la promesa de que habrá más si sigues ayudándonos.', '', '', '', '', '', '', 33528),
(58096, 'esES', 'Suministros de los rajani', 'Habla con Zhang Ku en el Valle de la Flor Eterna para obtener tu recompensa.', 'La Resistencia te agradece toda la ayuda que nos has prestado.\n\nAcepta estos suministros como muestra de nuestra gratitud, así como la promesa de que habrá más si sigues ayudándonos.', '', '', '', '', '', '', 33528),
(58087, 'esES', 'Destruir la fuente', 'Destruye $1oa células de energía de Nazesh en los Bajíos Perlatriste.', 'La clamamareas Nezara lidera todo esto. Si la eliminamos, los demás nagas romperán filas, pero no será fácil llegar hasta ella. La protege una barrera mágica que funciona mediante unas células de energía cercanas.\n\nSi conseguimos destruir la fuente de energía, podremos acabar con Nezara.', '', '', '', '', '', '', 33528),
(58010, 'esES', '¡Más trozos, más!', 'Consigue $1oa trozos de aqir.', 'Necesitamos más muestras de aqir, $p. ¡Todas las que puedas conseguir!\n\nYa he hecho algunos hallazgos fascinantes, pero queda mucho por descubrir.\n\nSi logramos estudiarlas con más detalle y tenemos algo de suerte, tal vez empecemos a destapar poco a poco algunos de sus puntos débiles.', '', '', '', '', '', '', 33528),
(58009, 'esES', 'A la luna', 'Elimina la amenaza aqir del Obelisco de la Luna.', '¡Bueno! Hora de largarse de aquí.\n\nTenemos que volver al campamento y contarle a Arik lo que ha pasado lo antes posible.\n\nVamos al bombardero y llenémoslo de combustible.\n\nTe dejaré el puesto de artillero, pero el avión lo llevo yo, ¡así que intentemos cargarnos unos cuantos bichos por el camino!', '', '', '', '', '', '', 33528),
(58008, 'esES', 'Combustible a tope', 'Consigue $1oa latas de combustible.', 'Pues estaba revisando los aviones... y no te lo vas a creer, ¡pero no hay ni uno con combustible en el depósito!\n\nHe visto unas cuantas latas desperdigadas por aquí cerca, supongo que en alguna quedará gasolina.\n\nIba a ir yo a por ellas, pero esos condenados bichos han salido de la nada y han abarrotado el lugar.\n\nYa son demasiados para encargarme de ellos sola. ¿Crees que podrías echarme una mano?', '', '', '', '', '', '', 33528),
(57990, 'esES', 'Obelisco del Sol', 'Localiza a la exterminadora Zahra en el Obelisco del Sol.', 'Debo pedirte una cosa más, $gamigo mío:amiga mía;. Esta tarea es vital para nuestra supervivencia aquí.\n\nNuestra camarada Zahra se ha empeñado en subir a la meseta que hay al este para apropiarse de uno de los viejos bombarderos que quedaron allí.\n\nHasta ahora, nuestros intentos de informar a Arik han fracasado.\n\nSin embargo, si puedes ayudarla a hacer funcionar uno de esos aviones, tal vez tengamos una posibilidad.\n\nEspero que puedan enviar ayuda antes de que nos arrollen...', '', '', '', '', '', '', 33528),
(57974, 'esES', 'Heroica: La batalla por Costa Oscura', '', '', '', '', '', '', '', '', 33528),
(57973, 'esES', 'Heroica: La batalla por Costa Oscura', '', '', '', '', '', '', '', '', 33528),
(57971, 'esES', 'Ruinas de Ammon', 'Viaja a las Ruinas de Ammon.', '¡Estas cosas parecen estar en todas partes a la vez!\n\nO se trata de un ataque organizado, o son muchos más de los que podemos llegar a comprender.\n\nEn cualquier caso, esto es malo para nosotros... Muy muy malo.\n\n$p, necesito que vayas a las Ruinas de Ammon y descubras cuál es la situación allí.\n\n¡Si necesitan ayuda, intenta echar una mano!', '', '', '', '', '', '', 33528),
(57970, 'esES', 'Devastador Xok\'nixx', 'Mata al devastador Xok\'nixx.', 'Ar\'kali y un grupo de nuestros guerreros se enfrentan a una mole de criatura en mitad de las ruinas.\n\nElla es capaz de defenderse de casi cualquier enemigo, pero me temo que solo es cuestión de tiempo que ese monstruo los acabe agotando.\n\nAunque por ahora lo mantienen ocupado, si nuestros guerreros caen perderemos las ruinas.\n\nDate prisa, por favor, seguro que con tu ayuda logran abatir al titánico adversario.', '', '', '', '', '', '', 33528),
(57969, 'esES', 'Atender a los heridos', 'Sana a $1oa obreros Vagayermos.', 'Como puedes ver, $gamigo mío:amiga mía;, esas criaturas horribles nos tienen sitiados.\n\nMuchos de nuestros camaradas han sido presa de los monstruos, pero por suerte aquí tenemos guerreros suficientes para mantener la amenaza controlada... por ahora.\n\nSi puedes ayudarnos, te pido que atiendas a nuestros heridos y ayudes a abrir un camino que les permita escapar de las ruinas.', '', '', '', '', '', '', 33528),
(57962, 'esES', 'Heroica: La batalla por Costa Oscura', '', '', '', '', '', '', '', '', 33528),
(57961, 'esES', 'Heroica: La batalla por Costa Oscura', '', '', '', '', '', '', '', '', 33528),
(57960, 'esES', 'Frente de guerra heroico: La batalla por Costa Oscura', 'Derrota a la Horda en la batalla por Costa Oscura.', 'No dejaremos que se sigan produciendo ataques de la Horda en nuestros territorios.\n\nLos elfos de la noche no lucharán solos. Recuperarán Costa Oscura.\n\n¡Por la Alianza!', '', '', '', '', '', '', 33528),
(57959, 'esES', 'Frente de guerra heroico: La batalla por Costa Oscura', 'Derrota a la Alianza en la batalla por Costa Oscura.', '¡Costa Oscura pertenece a la Horda! Debemos defender esa posición para seguir controlando Kalimdor.\n\nPreparaos. ¡La batalla aguarda!', '', '', '', '', '', '', 33528),
(57956, 'esES', 'Huéspedes Vagayermos', 'Mata a $2oa huéspedes Vagayermos.', 'Los bichos han estado poniendo huevos en los cadáveres de nuestros soldados, ¡es aterrador!\n\nAlgunos se levantan del suelo como monstruosidades pútridas, abotagadas y horrendas.\n\nDebemos detenerlos antes de que sigan incrementando sus filas con nuestros caídos.\n\nNo es una tarea agradable... pero debo pedirte que me ayudes a destruirlos. Por completo.\n\nToma unas cuantas de las bombas que tengo ahí detrás, si quieres.', '', '', '', '', '', '', 33528),
(57955, 'esES', 'Al Puerto de Ankhaten', 'Encuentra a la rastreadora Samara en el Puerto de Ankhaten.', 'Me temo que aún no tengo fuerzas para salir a las arenas a enfrentarme de nuevo con esos monstruos.\n\nVe hacia el sur y busca a la rastreadora Samara en el campamento de excavación anteriormente conocido como Embarcadero de Schnottz.\n\nDile que detenga a todas las caravanas que pretendan pasar por aquí, para evitar que otras sufran emboscadas y acaben teniendo tan horripilante final.\n\n¡Debemos hacer correr la voz por todo Uldum antes de que nuestras fuerzas queden más divididas!', '', '', '', '', '', '', 33528),
(57954, 'esES', 'Quema los cuerpos', 'Quema $1oa cadáveres con huevos.', 'Los bichos parecen estar poniendo huevos de forma indiscriminada en los cadáveres de las cercanías.\n\nLos usan como alimento para engendrar más de esas criaturas espantosas. ¡Es repugnante!\n\nYa lloraremos luego a los caídos, pero si permitimos que sigan eclosionando nuevos bichos, puede que no sobrevivamos para hacerlo.\n\n¡Quema los cadáveres y destruye esos huevos!', '', '', '', '', '', '', 33528),
(57915, 'esES', 'Busca supervivientes', 'Examina a $1oa Vagayermos en Orsis.', 'Los bichos aparecieron por todas partes... No tuvimos tiempo de reaccionar.\n\nMuchos de mis amigos murieron allí mismo, mientras que otros intentaron combatir con nuestras exiguas herramientas.\n\nSoy un cobarde. Hui en medio del revuelo en vez de intentar ayudar.\n\nY ahora aquí me tienes, sin comida, sin agua y demasiado asustado como para ir a buscar supervivientes.\n\nTe lo ruego, ayuda a quien encuentres aún con vida en Orsis...', '', '', '', '', '', 'Encuentra al escolta Lashan en Orsis.', 33528),
(57873, 'esES', 'Noticias de Orsis', 'Investiga la situación en Orsis.', 'Como puedes ver, $n, aquí estamos muy ocupados con esos bichos repugnantes.\n\nNuestras caravanas del sur han dejado de llegar, y tenemos inquietantes noticias de los pocos que han logrado volver recientemente.\n\nEnvié una patrulla hacia Orsis a investigar y ya deberían haber regresado.\n\n¿Podría pedirte que fueras a ver cómo están?', '', '', '', '', '', '', 33528),
(57774, 'esES', 'Siete vidas', 'Destruye a $1oa moradores de Neferset.', 'Hace poco regresaron los exploradores, casi al borde de la muerte, traían informes que me resultan... desconcertantes.\n\nHan visto a moradores de Neferset deambulando por las calles de su ciudad, al sur.\n\nEsto no debería ser motivo de alarma, salvo porque los moradores de Neferset fueron aniquilados en el pasado.\n\nDebo pedirte que investigues más a fondo... y si por alguna magia vil los informes resultan ser ciertos, ¡haz lo que sea necesario para contener esta amenaza!', '', '', '', '', '', '', 33528),
(57773, 'esES', 'Cerrar los desgarros', 'Localiza y sella $1oa desgarros del Vacío en Uldum.', 'Nuestros guerreros han observado manifestaciones nauseabundas procedentes de los numerosos desgarros del Vacío en la selva circundante.\n\nMeros alfeñiques, claramente destinados a poner a prueba nuestras defensas antes de que lleguen las fuerzas de verdad.\n\nPero si no nos ocupamos ahora de esta amenaza, será solo cuestión de tiempo que nos arrolle su carne de cañón.\n\n¡Busca un modo de cerrar esos portales!', '', '', '', '', '', '', 33528),
