(57737, 'esES', 'Rescate de Ramkahen', 'Rescata a $1oa habitantes de Mar\'at.', 'Mar\'at fue invadida por esos asquerosos k\'thir antes de que pudiéramos evacuar como es debido a nuestros ciudadanos.\n\nTemo que les haya pasado lo peor.\n\nPor favor, si queda alguien vivo en la ciudad, dile que venga a Ramkahen.', '', '', '', '', '', '', 33528),
(57728, 'esES', 'Asalto: El enjambre interminable', 'Rechaza el asalto mántide en el Valle de la Flor Eterna.', '¡El enjambre mántide va en aumento! Es imposible que el Loto Dorado pueda con tantos.\n\n¡Debemos hacer algo para conseguir que retrocedan!', 'Vuelve con Taoshi, que está en El Santuario Silente.', '', '', '', '', 'Vuelve con Taoshi, que está en El Santuario Silente.', 33528),
(57721, 'esES', 'Botín de guerra', 'Consigue $1oa piezas de armadura mogu recuperada de los enemigos mogu en el Valle de la Flor Eterna.', 'Los clanes enfrentados son implacables, y nuestros guerreros gastan armadura más deprisa de lo que puedo repararla.\n\nSi te encuentras en combate con los otros clanes, intenta recuperar las piezas de armadura intactas de sus soldados. No desperdiciemos buenos recursos.', '', '', '', '', '', '', 33528),
(57720, 'esES', 'Campeones de los mogu', 'Derrota a 3 enemigos poco comunes mientras los mogu están invadiendo el Valle de la Flor Eterna.', 'Hay que poner en su sitio a esos clanes inferiores que se enfrentan entre sí en el valle.\n\nBusca a sus campeones y elimínalos. ¡Demuéstrales que los únicos que tienen derecho legítimo en este lugar son los rajani!', '', '', '', '', '', '', 33528),
(57718, 'esES', 'Atados a la piedra', 'Recoge varas de labrapiedras baruk y úsalas para liberar a $1oa guerreros petrificados en las Ruinas de Guo-Lai.', 'Algunos de nuestros guerreros estaban acampados en el pequeño asentamiento cercano a Guo-Lai, cuando los baruk invadieron la zona. Unos cuantos lograron escapar, pero nos contaron que los labrapiedras mogu habían convertido a sus hermanos de armas en estatuas vivientes.\n\n¡No podemos abandonarlos!\n\nSeguro que los labrapiedras llevan algo para revertir el hechizo y liberarlos de sus prisiones de piedra. ¡Rescata a nuestros soldados!', '', '', '', '', '', '', 33528),
