(57524, 'esES', 'Acceder a los archivos', 'Habla con MADRE para activar el archivo de investigación titánico y luego examina los archivos.', 'La información que has conseguido nos ha permitido entender mejor estas manifestaciones.\n\nCreo que MADRE quiere compartir algunos de sus hallazgos contigo.', '', '', '', '', '', '', 33528),
(57522, 'esES', 'Llamada del Vacío', '', '', '', '', '', '', '', '', 33528),
(57521, 'esES', 'Carro de guerra potenciado', '', '', '', '', '', '', '', '', 33528),
(57519, 'esES', 'Invocador de enjambre', '', '', '', '', '', '', '', '', 33528),
(57517, 'esES', 'Invocador de enjambre', '', '', '', '', '', '', '', '', 33528),
(57508, 'esES', 'Estandarte de guerra Zara\'thik', '', '', '', '', '', '', '', '', 33528),
(57497, 'esES', 'Difundir la noticia', 'Informa a Aysa Canción Etérea, que está en Ventormenta.', '¡Queríamos salvar una vida y hemos logrado mucho más que eso!\n\nSin ti no lo habríamos conseguido, $n. Tengo grandes esperanzas para el futuro de todos los gnomos.\n\n¡Regresa a Ventormenta y comparte la buena nueva!', '', '', '', '', '', 'Informa a Aysa Canción Etérea, que está en Ventormenta.', 33528),
(57496, 'esES', 'Ascensión', 'Elimina a los defensores de Mecandria que queden.', 'Después de todo lo que los mecagnomos han hecho hoy por nosotros, tenemos que devolverles el favor.\n\nDeshagámonos de las creaciones rebeldes que queden en Mecandria.\n\nAhora que han recuperado su hogar, el príncipe Erazmin y su pueblo tendrán un futuro prometedor.\n\nCon este equipo, despacharemos enseguida a los leales al rey Mecandria que queden.\n\n¡Avísame cuando estés a punto para la acción!', '', '', '', '', '', 'Habla con Gelbin Mekkatorque.', 33528),
(57495, 'esES', 'El futuro de Mecandria', 'Ve a la Alta Trastería, que está en la Ciudad de Mecandria.', 'Ahora que la Ciudad de Mecandria ya está limpia de los peligros que quedaban, puede que vuelva a ser un lugar de paz y prosperidad para gnomos y mecagnomos.\n\nEs hora de que hable con el príncipe Erazmin sobre el futuro de nuestros pueblos. ¡Tengo la sincera esperanza de que forjaremos una unión que perdurará durante generaciones!\n\nCuando estés $glisto:lista;, ven a la Alta Trastería para oír un discurso especial.', '', '', '', '', '', '', 33528),
(57494, 'esES', 'Un corazón fuerte', 'Recupera el reactor de chispas y completa el procedimiento de Mekkatorque.', 'Vimos una bengala cerca del Depósito Trastovatio.\n\nEl equipo de recuperación ha conseguido la fuente de energía. Por fin estamos a salvo del Aniquilotrón del rey Mecandria, y su corazón servirá para un nuevo propósito.\n\n¡Es una noticia fabulosa!\n\nSin embargo, la bengala significa que tienen compañía. Necesitamos tu ayuda para sacar de allí al equipo y recuperar el reactor de chispas.\n\nDate prisa, por favor, nos queda muy poquito para terminar.', '', '', '', '', '', 'Reúnete con el príncipe Erazmin en Pernoóxido.', 33528),
(57493, 'esES', 'Armonización mental', 'Activa el sincroscopio cuando Christy te avise.', 'Ahora que sabemos lo básico sobre quién es Mekkatorque, parece que podría haber margen de mejora.\n\nTu ayuda es necesaria para mantenerlo estabilizado y sincronizado antes de sacarlo de su cápsula.\n\nColócate junto al sincroscopio. Yo realizaré unos ajustes y tú tendrás que encender la máquina cuando te avise.', '', '', '', '', '', '', 33528),
(57492, 'esES', '¿Él?', 'Recopila información de los gnomos y mecagnomos de Mecandria.', 'Habla con unos cuantos gnomos de Mecandria, mejorados o no. A los míos, pregúntales qué esperan de un líder. A nuestros nuevos amigos, pregúntales qué valoran más de su actual líder.\n\nPor lo que he oído, el manitas mayor siempre ha dirigido a su gente por necesidad, nunca buscó ni deseó la corona. Creo que los gnomos deberían volver a estar unidos.\n\nBusco la solución que mejor se adapte a todos. ¿Me conseguirás la información que necesito?', '', '', '', '', '', '', 33528),
(57491, 'esES', 'Mejores... Más fuertes... Menos muertos', 'Consigue el acelerador neural, el omniamplificador electromagnético y los servos de flujo energizados de las unidades erráticas.', 'Puede que el rey Mecandria fuera un loco, pero sus esbirros tenían una capacidad extraordinaria para la creación robótica.\n\nAún deambulan por Mecandria unas cuantas creaciones residuales que se niegan a aceptar el destronamiento del rey Mecandria.\n\nLo lógico habría sido que se retirasen los que quedasen operativos tras la derrota, pero algunos no destacan precisamente por su lógica.\n\nY llevan los últimos avances técnicos. Creo que hacernos con piezas específicas de esas unidades sería muy beneficioso para nuestra recuperación.', '', '', '', '', '', 'Reúnete con Christy en la cápsula de escape de Mekkatorque.', 33528),
(57490, 'esES', 'Viajar a un lugar seguro', 'Derrota a los troggs carroñeros y recupera la cápsula de escape de Mekkatorque.', 'Uno de nuestros defensores vio a los troggs abatir al cóptero buscador que transportaba la cápsula de Mekkatorque.\n\nDesde que empezamos a traer mercancías desde Tiragarde, han sido un auténtico incordio.\n\nPistón, un joven y prometedor inventor, tiene un vehículo capaz de realizar esta tarea. Reúnete con su equipo en el Vertedero de Bondo.\n\n¡Date prisa en recuperar la cápsula, por favor! No sé qué podría pasarle a Gelbin si la abren.\n\nEjem, y ya de paso no nos importaría que hicieras un poco de limpieza en la playa.', '', '', 'Ojóxido el Listo', '', '', 'Reúnete con Waren Ciervoacople en Pernoóxido.', 33528),
(57488, 'esES', 'El esquema actual', 'Reúne $1oa mocos con tolerancia al calor y $2oa piezas de máquinas adquiridas.', 'Creo que puedo modificar uno de nuestros dispositivos para llegar hasta Gelbin Mekkatorque sin alterar sus constantes vitales.\n\nPero necesitaré que me consigas unos objetos.\n\nEn el vector cercano de las Chatarrerías encontrarás robots de chatarra y canes de chatarra. Serán una buena fuente de piezas de repuesto para mi proyecto de construcción.\n\nEn El Vertido viven unas criaturas especialmente viscosas. Gracias a ellas obtendrás unos ingredientes excelentes para el lubricante resistente al calor que necesitamos.', '', '', '', '', '', '', 33528),
(57487, 'esES', 'Alguien capaz de ayudar', 'Ayuda a Kelsey a llevar la cápsula de escape de Mekkatorque a Mecandria.', 'Creo que hay un modo de ayudar a Mekkatorque, aunque puede que no convenza a todo el mundo...\n\nLos mecagnomos cuentan con técnicas avanzadas de reparación y mejoras biomecánicas.\n\nSi existe la más mínima posibilidad de que le sirvan de ayuda, ¡debemos intentarlo! Hay mecagnomos que envían suministros a la isla desde un muelle de Puntagarfio. Nadie se fijará en que hay un paquete más. Tenemos que redirigir uno de sus cópteros buscadores.\n\n¿Me ayudas a llevar la cápsula de Mekkatorque a Mecandria?', '', '', '', '', '', 'Habla con el príncipe Erazmin en la Isla de Mecandria.', 33528),
(57486, 'esES', 'Energía menguante', 'Reúnete con Kelsey Chispacero en el Fuerte Valiente.', 'La cápsula de Mekkatorque se está quedando sin energía.\n\nYa no podemos oírlo hablar.\n\nEl pulso se le ha ralentizado, pese a todos los esfuerzos de los sanadores de Kul Tiras.\n\nTengo una idea, pero voy a necesitar tu ayuda.\n\nReúnete conmigo en el Fuerte Valiente. Debemos partir pronto.', '', '', '', '', '', '', 33528),
(57484, 'esES', 'Ritual del despertar', '', '', '', '', '', '', '', '', 33528),
(57476, 'esES', 'Zona de alimentación Vil\'thik', '', '', '', '', '', '', '', '', 33528),
(57464, 'esES', 'Enfocar la atención', 'Consigue $1oa jirones de demencia. Puedes despojarlos de jefes de Ny\'alotha y jefes del mundo; obtenerlos al ganar en campos de batalla o arenas, o mediante muertes con honor.', 'El enfoque del Vacío contiene una fracción ínfima del poder de N\'Zoth. Si lo potenciamos, podremos crear armas más efectivas para usarlas contra él.\n\nLa influencia de N\'Zoth está por todos lados, $n, pero se concentra en los enemigos más poderosos. Acaba con ellos y hazte con los vestigios que queden del poder del dios antiguo.', '', '', '', '', '', '', 33528),
(57462, 'esES', 'Atrapasueños', 'Consigue $1oa jirones de demencia. Puedes despojarlos de jefes de Ny\'alotha y jefes del mundo; obtenerlos al ganar en campos de batalla o arenas, o mediante muertes con honor.', 'Parece que el enfoque sigue estable y su campo de contención intacto. Me atrevería a decir que aún podemos potenciarlo un poco más.\n\nEncuentra y acaba con enemigos formidables para adquirir más restos de la influencia de N\'Zoth. Esta vez imbuiremos el enfoque de una mayor cantidad de poder del dios antiguo. Estoy convencido de que el campo de contención podrá soportarlo.', '', '', '', '', '', '', 33528),
(57453, 'esES', 'Invocador de enjambre', '', '', '', '', '', '', '', '', 33528),
(57449, 'esES', 'Ejecutor de N\'Zoth', '', '', '', '', '', '', '', '', 33528),
(57448, 'esES', 'Nuevos aliados entre nosotros', 'Presencia cómo Baine da la bienvenida a los vulperas a la Horda.', 'Ni siquiera en tiempos de paz está la Horda exenta de problemas.\n\nAunque a veces pueden resultar abrumadoras, nuestras pugnas nunca deberían hacernos olvidar lo que significa formar parte de la Horda.\n\nNo abandonamos a la gente en tiempos difíciles; nos agrupamos y resistimos.\n\nPero por un instante, yo mismo me olvidé. Con todos los problemas a los que se enfrentaban nuestros nuevos aliados, desestimé precipitadamente a los vulperas.\n\nSolo espero que todavía valoren tanto a la Horda como yo a ellos.', '', '', '', '', '', '', 33528),
(57445, 'esES', 'Carrito de fideos de Chin', '', '', '', '', '', '', '', '', 33528),
(57429, 'esES', 'Pira del Amalgamado', '', '', '', '', '', '', '', '', 33528),
(57404, 'esES', 'Colmena de devastadores', '', '', '', '', '', '', '', '', 33528),
(57403, 'esES', 'Reconstruir \"Temor y carne\"', 'Recupera páginas arrancadas de \"Temor y carne\" de áreas corruptas o perdidas en las visiones horripilantes para Wrathion en la Cámara del Corazón.', 'Puede que lo más artero de los susurros de los dioses antiguos sea que contienen una pizca de verdad. No se puede negar la alegría de sentir el sol en la piel y el viento en el cabello.\n\nPero tú te has enfrentado a las visiones de N\'Zoth. Has visto hacia dónde se dirige su plan. La maldición de la carne no tiene nada que ver con traernos alegría.\n\nSigue recolectando las páginas de este libro. Ya casi hemos acabado de completarlo.', '', '', '', '', '', '', 33528),
(57402, 'esES', 'Reconstruir \"Maldición de piedra\"', 'Recupera páginas arrancadas de \"Maldición de piedra\" de visiones horripilantes para Wrathion en la Cámara del Corazón.', 'N\'Zoth es conocido por su sutileza y su perfidia. Entiendo que una mente impresionable pudiera volverse contra los titanes al leer estas palabras. Por suerte, con nosotros esa manipulación no funciona, ¿eh?\n\nEl libro está casi completo. Sigue buscando sus páginas en las visiones.', '', '', '', '', '', '', 33528),
(57399, 'esES', 'Reconstruir \"La verdad definitiva\"', 'Recupera páginas arrancadas de \"La verdad definitiva\" de áreas perdidas en las visiones horripilantes para Wrathion en la Cámara del Corazón.', 'Conozco este libro. Es un tomo sagrado para los que adoran a los dioses antiguos que contiene los más oscuros secretos y los misterios más incomprensibles del Vacío. Solo los cultores más devotos están autorizados a leer sus páginas.\n\nAun estando incompleto, sostenerlo me da escalofríos. Debo procurar no leer demasiado de una sola vez.\n\nDicho esto, hay que encontrar las páginas que faltan para avanzar en nuestra investigación. Recupéralas en los rincones más oscuros de las visiones de N\'Zoth.', '', '', '', '', '', '', 33528),
(57398, 'esES', 'Caminar en la oscuridad', 'Recupera una copia de \"La verdad definitiva\" de áreas perdidas en las visiones horripilantes para Wrathion en la Cámara del Corazón.', 'El fin está cerca. Nos aguardan los recovecos más oscuros de estas visiones.\n\nGracias a nuestro trabajo estás bien $gequipado:equipada; para buscar las manifestaciones más horripilantes de estas visiones. Las últimas respuestas están a un paso. Nuestros preparativos para Ny\'alotha ya casi están listos.', '', '', '', '', '', '', 33528),
(57397, 'esES', 'Reconstruir \"Temor y carne\"', 'Recupera páginas arrancadas de \"Temor y carne\" de áreas corruptas o perdidas en las visiones horripilantes para Wrathion en la Cámara del Corazón.', 'Puede que lo más artero de los susurros de los dioses antiguos sea que contienen una pizca de verdad. No se puede negar la alegría de sentir el sol en la piel y el viento en el cabello.\n\nPero tú te has enfrentado a las visiones de N\'Zoth. Has visto hacia dónde se dirige su plan. La maldición de la carne no tiene nada que ver con traernos alegría.\n\nSigue recolectando las páginas de este libro. Ya casi hemos acabado de completarlo.', '', '', '', '', '', '', 33528),
(57396, 'esES', 'Reconstruir \"Temor y carne\"', 'Recupera páginas arrancadas de \"Temor y carne\" de áreas corruptas o perdidas en las visiones horripilantes para Wrathion en la Cámara del Corazón.', 'Los adeptos de los dioses antiguos dicen que la carne es un regalo, no una maldición. Este tomo reflexiona sobre la supuesta benevolencia de los dioses antiguos por otorgarnos una bendición tan generosa.\n\nPor supuesto, omite cualquier mención de lo que ocurre cuando se deja que su corrupción se extienda sin medida.\n\nRecupera más páginas de estas. Por despreciables que sean las palabras que contiene, estudiarlas nos permitirá aumentar la eficacia de tu capa.', '', '', '', '', '', '', 33528),
(57395, 'esES', 'Reconstruir \"Temor y carne\"', 'Recupera páginas arrancadas de \"Temor y carne\" de áreas corruptas o perdidas en las visiones horripilantes para Wrathion en la Cámara del Corazón.', 'Los adeptos de los dioses antiguos dicen que la carne es un regalo, no una maldición. Este tomo reflexiona sobre la supuesta benevolencia de los dioses antiguos por otorgarnos una bendición tan generosa.\n\nPor supuesto, omite cualquier mención de lo que ocurre cuando se deja que su corrupción se extienda sin medida.\n\nRecupera más páginas de estas. Por despreciables que sean las palabras que contiene, estudiarlas nos permitirá aumentar la eficacia de tu capa.', '', '', '', '', '', '', 33528),
(57394, 'esES', 'Reconstruir \"Temor y carne\"', 'Recupera páginas arrancadas de \"Temor y carne\" de áreas corruptas o perdidas en las visiones horripilantes para Wrathion en la Cámara del Corazón.', 'Otro tomo escrito por alguien que sucumbió a la locura de N\'Zoth. Me aterra pensar qué viles palabras nos esperan en él.\n\nPero, si queremos potenciar tu capa, debemos conocer mejor aquello a lo que debe resistir. A ver si encuentras las páginas restantes para que podamos completar este tomo y usar la información que contiene.', '', '', '', '', '', '', 33528),
(57393, 'esES', 'Avanzar por la oscuridad', 'Recupera una copia de \"Temor y carne\" de las profundidades de una visión horripilante para Wrathion en la Cámara del Corazón.', 'Ya habrás notado que la protección de tu capa mengua cuanto más te adentras en las visiones.\n\nPara potenciar aún más tu resistencia a la influencia de N\'Zoth tendremos que obtener un conocimiento más profundo de su nefasto poder.\n\nIntenta obtener información de las manifestaciones que hay en lo profundo de las visiones y pronto conseguiremos respuestas.', '', '', '', '', '', '', 33528),
(57392, 'esES', 'Reconstruir \"Maldición de piedra\"', 'Recupera páginas arrancadas de \"Maldición de piedra\" de visiones horripilantes para Wrathion en la Cámara del Corazón.', 'De momento, el contenido de este libro resulta desconcertante. Sin embargo, he conseguido recopilar información útil sobre la naturaleza del poder de N\'Zoth y he modificado tu capa a raíz de ella.\n\nDe todas formas, aún queda mucho por aprender. Sigue buscando páginas en las visiones.', '', '', '', '', '', '', 33528),
(57391, 'esES', 'Reconstruir \"Maldición de piedra\"', 'Recupera páginas arrancadas de \"Maldición de piedra\" de visiones horripilantes para Wrathion en la Cámara del Corazón.', 'Encontré varias referencias a este libro en mis investigaciones sobre Ny\'alotha. Lo escribió un cultor neófito: documenta las \"mentiras de los titanes\" y las \"injusticias\" que infligieron a los habitantes de Azeroth.\n\nDesvaríos que pretenden erosionar la capacidad del lector para aceptar la realidad.\n\nSin embargo, al estudiar esta obra, podremos comprender mejor el poder del dios antiguo y adaptar la capa para ofrezca mejor protección contra él.\n\nTrae todas las páginas de este tomo que consigas.', '', '', '', '', '', '', 33528),
(57384, 'esES', 'Monstruosidad reparadora', '', '', '', '', '', '', '', '', 33528),
(57379, 'esES', 'Estatua de jade infestada', '', '', '', '', '', '', '', '', 33528),
(57378, 'esES', 'Restos de un mundo destrozado', 'Recupera una copia de \"Maldición de piedra\" de una visión horripilante para Wrathion en la Cámara del Corazón.', 'La información que hemos adquirido con estas visiones nos brinda una oportunidad única de protegernos mejor la mente frente a la corrupción. Para seguir con nuestra investigación, debemos ahondar en los misterios más profundos de estas experiencias.\n\nBusca a quienes detentan poder en estas visiones. Si encuentras algo interesante, no dudes en compartir tus hallazgos.\n\nMientras tanto, MADRE y yo seguiremos investigando aquí en la cámara.\n\nEsperamos tu regreso, $n.', '', '', '', '', '', '', 33528),
(57376, 'esES', 'La necesidad oculta', 'Reúnete con Lilian Voss en los Claros de Tirisfal.', 'Debido a Sylvanas, algunos de los miembros de la Horda son escépticos respecto a los Renegados. Debemos recuperar su confianza.\n\nY no podemos hacerlo si no nos aceptamos como somos. Muchos se sienten perdidos, solos..., abandonados.\n\nHe organizado un encuentro. Podría resultar muy beneficioso... o salir terriblemente mal. Sea como sea, deberías asistir.\n\nReúnete conmigo en los Claros de Tirisfal, en los Dominios de Calston.', '', '', '', '', '', '', 33528),
(57375, 'esES', 'Túmulo palpitante', '', '', '', '', '', '', '', '', 33528),
(57374, 'esES', 'Hacia las profundidades más oscuras', 'Adéntrate en una visión horripilante para descubrir qué manifestaciones oscuras le esperan a un mundo gobernado por N\'Zoth.', 'Una vez asegurada nuestra conexión, es hora de que atravesemos el velo y averigüemos qué hay más allá.\n\nTus hallazgos quizás nos ofrezcan la clave para conseguir el éxito.', '', '', '', '', '', '', 33528),
(57373, 'esES', 'Descender a la locura', 'Busca una visión de N\'Zoth en medio de la corrupción del Valle de la Flor Eterna o de Uldum para descubrir lo que el futuro depara a Azeroth.', 'Por mala que parezca la propagación de la corrupción, creo que podría servirnos como ensayo para lo que nos espera más adelante.\n\nLocaliza una de esas incursiones y fíjate en lo que ocurre cuando miras más allá del velo oscuro.', '', '', '', '', '', '', 33528),
(57372, 'esES', 'La Calle Mayor', '', '', '', '', '', '', '', '', 33528),
(57371, 'esES', 'Asalto: Aqir desenterrados', '', '', '', '', '', '', '', '', 33528),
(57370, 'esES', 'Asalto: El Imperio Negro', '', '', '', '', '', '', '', '', 33528),
(57362, 'esES', 'Adentrarse en la oscuridad', 'Habla con MADRE para volver a las Cámaras de los Orígenes de Uldum a descubrir la fuente de la anomalía.', 'Tras este último giro de los acontecimientos, podemos seguir intentando descubrir la oscuridad que hay más allá de las arenas.\n\nNo será fácil, $n. Estamos al borde de lo desconocido, pero ahora han cambiado las tornas.\n\n<Wrathion echa una mirada a tu atuendo>.\n\nVas $gvestido:vestida; para la ocasión.\n\nVeamos qué información saca a la luz tu retorno a las Cámaras de los Orígenes.', '', '', '', '', '', '', 33528),
(57359, 'esES', 'Ritual de invocación', '', '', '', '', '', '', '', '', 33528),
(57339, 'esES', 'Ritual de construcción', '', '', '', '', '', '', '', '', 33528),
(57324, 'esES', 'Zarpar con la marea', 'Reúnete con Calia Menethil y Derek Valiente.', 'Hola, $p.\n\nCalia me ha hecho llegar que quiere que nos volvamos a reunir con ella.\n\nTiene mucho que ofrecer a quienes se sienten perdidos, a quienes buscan una vía mejor. En cuanto se libre de las dudas, sabrá qué es lo que hay que hacer.\n\n¿Vienes?', '', '', '', '', '', '', 33528),
(57290, 'esES', 'Iniciar el descenso', 'Hazte con la dragontina negra corrupta del Descenso de Alanegra, que está en lo alto de la Montaña Roca Negra, en Las Estepas Ardientes.', 'Para protegerse la mente contra los dioses antiguos hace falta un objeto de corrupción pura. Aunque muchos no lo saben, existe un objeto así, inactivo bajo los pozos de lava del Descenso de Alanegra.\n\nHasta hace poco, uno de mis agentes vigilaba la zona y mantenía registros detallados de las actividades sospechosas. Por desgracia, ha dejado de dar señales. Es evidente que ya no somos los únicos que lo sabemos.\n\nSi queremos respuestas, hay un sitio donde buscarlas.\n\nNuestro viaje continúa, $n. Roca Negra aguarda.', '', '', '', '', '', 'Vuelve con Wrathion, que está en la Cámara del Corazón.', 33528),
(57282, 'esES', 'Barrio de los Magos', '', '', '', '', '', '', '', '', 33528),
(57276, 'esES', 'Enfocar la atención', 'Consigue $1oa jirones de demencia. Puedes despojarlos de jefes de Ny\'alotha y jefes del mundo; obtenerlos al ganar en campos de batalla o arenas, o mediante muertes con honor.', 'El enfoque del Vacío contiene una fracción ínfima del poder de N\'Zoth. Si lo potenciamos, podremos crear armas más efectivas para usarlas contra él.\n\nLa influencia de N\'Zoth está por todos lados, $n, pero se concentra en los enemigos más poderosos. Acaba con ellos y hazte con los vestigios que queden del poder del dios antiguo.', '', '', '', '', '', '', 33528),
(57275, 'esES', 'Algo en la cabeza', 'Llévale el enfoque del Vacío a Wrathion, que está en la Cámara del Corazón.', '<Mientras examinas el cristal, la luz que te rodea se extingue lentamente tras un humo impenetrable. Una presencia imponente te abruma y te susurra algo ininteligible al oído. Tratas de averiguar de dónde procede, pero no ves nada; aun así, la sensación va en aumento. Sientes que se te va la cabeza a medida que la oscuridad se intensifica y el ruido se vuelve ensordecedor.\n\nHaces acopio de voluntad para no dejarte llevar...\n\nLa luz vuelve, el ruido cesa y ahí estás tú con un humilde cristal en la mano.\n\nTal vez Wrathion sepa algo más al respecto...>.', '', '', '', '', '', '', 33528),
(57272, 'esES', 'Efigie Vinculasangre', '', '', '', '', '', '', '', '', 33528),
(57271, 'esES', 'Distrito de Mercaderes', '', '', '', '', '', '', '', '', 33528),
(57243, 'esES', 'Campamento de esclavos amathet', '', '', '', '', '', '', '', '', 33528),
(57235, 'esES', 'Recolector solar', '', '', '', '', '', '', '', '', 33528),
(57234, 'esES', 'Recolector solar', '', '', '', '', '', '', '', '', 33528),
(57223, 'esES', 'Centinela desenterrado', '', '', '', '', '', '', '', '', 33528),
(57222, 'esES', 'Investigar las cámaras', 'Investiga la anomalía en las Cámaras de los Orígenes.', 'Lo que sea que esté pasando debe de proceder de muy dentro de la cámara interior. Si conseguimos llegar a la forja, tal vez encontremos respuestas.\n\nMás vale que revises tu equipo antes de entrar, $n. Quién sabe lo que nos depara ahí dentro.', '', '', '', '', '', '', 33528),
(57221, 'esES', 'Reoriginación', 'Reúnete con Magni Barbabronce ante las Cámaras de los Orígenes, que están en Uldum.', 'Si los Ramkahen no han hecho sonar ninguna alarma, es que la anomalía debe de estar contenida en las Cámaras de los Orígenes.\n\nMás vale que volvamos para investigar, $n.', '', '', '', '', '', '', 33528),
(57220, 'esES', 'Inicio del protocolo de activación', 'Transfiere energía de los sistemas auxiliares de la Cámara del Corazón, el Motor de Nalak\'sha y la Forja de los Orígenes y luego habla con MADRE para activar la Forja de los Orígenes.', 'Hemos progresado mucho, $n.\n\nEn cuanto volvamos a conectar los sistemas auxiliares, MADRE podrá realizar diagnósticos.\n\nYa solo queda colocar las últimas piezas en su sitio.', '', '', '', '', '', '', 33528),
(57219, 'esES', 'Centinela desenterrado', '', '', '', '', '', '', '', '', 33528),
(57218, 'esES', 'Centinela desenterrado', '', '', '', '', '', '', '', '', 33528),
(57217, 'esES', 'Centinela desenterrado', '', '', '', '', '', '', '', '', 33528),
(57216, 'esES', 'Casco Antiguo', '', '', '', '', '', '', '', '', 33528),
(57215, 'esES', 'Motor de ascensión', '', '', '', '', '', '', '', '', 33528),
(57157, 'esES', 'Asalto: El Imperio Negro', 'Rechaza el asalto de N\'Zoth en Uldum.', 'Es tal como predijeron las visiones. Las fuerzas oscuras pretenden hacerse con la Forja de los Orígenes.\n\n¡Si no los detenemos, será el fin para todo Azeroth!', 'Vuelve con el sumo sacerdote Amet, que está en Ramkahen.', '', '', '', '', 'Vuelve con el sumo sacerdote Amet, que está en Ramkahen.', 33528),
(57155, 'esES', 'Cegar al ojo', 'Habla con el hermano Pike para curarte de tu \"don\".', 'Ah, sí, justo $gel:la; $c que quería ver.\n\nAún siento su efecto en ti. Nuestra victoria sobre el dios de las profundidades no será completa hasta haber eliminado todo rastro de su infección.\n\nGracias a mis investigaciones he descubierto una forma menos dolorosa de acabar con ella.\n\nHabla conmigo y pongamos fin a esta pesadilla.', '', '', '', '', '', '', 33528),
(57153, 'esES', 'Distrito de los Enanos', '', '', '', '', '', '', '', '', 33528),
(57146, 'esES', 'Rasgadura de corrupción', '', '', '', '', '', '', '', '', 33528),
(57129, 'esES', 'Valle de la Sabiduría', '', '', '', '', '', '', '', '', 33528),
(57112, 'esES', 'Test Shared Quest', '', 'Ninguno', 'Test', '', '', '', '', '', 33528),
(57089, 'esES', 'Criadero Vil\'thik', '', '', '', '', '', '', '', '', 33528),
(57087, 'esES', 'Obliterador baruk', '', '', '', '', '', '', '', '', 33528),
(57085, 'esES', 'Carro de guerra potenciado', '', '', '', '', '', '', '', '', 33528),
(57079, 'esES', '¡Dale para el pelo!', 'Completa la gesta de Villaescoria.', '¡Caray, cómo me alegro de verte! Tenemos una situación complicada entre manos...\n\nMientras tú entregabas las invitaciones, ¡Gallywix y sus matones han tomado Villaescoria! ¡Han secuestrado a Hobart Martillazos y piensan retenerlo hasta que les entregue la armadura personal X-52!\n\n¡Tienes que detener a Gallywix antes de que sea demasiado tarde!', '', '', '', '', '', 'Habla con Hobart Martillazos.', 33528),
(57078, 'esES', 'La lista vip', 'Entrega las invitaciones a la subasta privada de Martillazos.', 'Mientras tú ayudabas a Martillazos con su último invento, yo me he dejado la piel buscando posibles compradores.\n\nSerá una subasta privada, así que invitaremos solo al público más selecto, a la flor y nata, lo más granado... ¿Entiendes?\n\nHe reducido los compradores potenciales a una lista escogida con solo los goblins más ricos, con más clase y mejor relacionados... ¡Menos Gallywix, claro!\n\n¡Sal a entregar estas invitaciones mientras yo termino los preparativos de la subasta!', '', '', '', '', '', '', 33528),
(57077, 'esES', '¡Se buscan compradores!', 'Habla con Sassy Malallave, que está en la Vega de Tuercespina.', 'La armadura personal X-52 por fin está completa, ¡y Gallywix se ha ido pitando con el rabo entre las piernas!\n\n¡Y todo gracias a ti, $n!\n\nPero aún no hemos terminado... Lo mejor aún está por llegar. ¡Vamos a organizar una subasta y a vender la armadura personal X-52 al mejor postor!\n\nSassy Malallave ya debería tener una lista de compradores interesados. ¡Corre al Escondrijo Malallave y dile que estamos listos para la subasta!', '', '', '', '', '', '', 33528),
(57076, 'esES', 'Volver a Bruma Otoñal', 'Vuelve con el hablatormentas Qian, que está en El Santuario Silente, en el Valle de la Flor Eterna.', 'Aquí ya hemos hecho todo lo que podíamos. Ya sabemos la amenaza que suponen los mogu.\n\nLa forja corre el grave peligro de caer en sus manos si perdemos el valle.\n\nVolvamos a Bruma Otoñal a informar a los rajani. Querrán saber a qué nos enfrentamos.', '', '', '', '', '', 'Vuelve con el hablatormentas Qian, que está en el Santuario Silente, en el Valle de la Flor Eterna.', 33528),
(57075, 'esES', 'Coraje líquido', 'Monta en Mobi y derrota a los ejércitos mogu con el poder de la cerveza.', 'Algo tenemos que hacer con todos esos mogu. ¡Por lo menos hay que reducir sus efectivos antes de que invadan el valle!\n\nPor más que al tío Chen le guste la cerveza, creo que podemos darle mejor uso. ¡Montémonos en el yak y démosles a los mogu algo que temer!', '', '', '', '', '', '', 33528),
(57074, 'esES', 'Regreso a la puerta', 'Monta en Mobi con Chen y Li Li para ir a la Puerta de los Augustos Celestiales.', 'Qué suerte que hayas encontrado esta cerveza, ¡y un yak para transportarla!\n\nPero no podemos quedarnos aquí. Li Li me ha sanado lo justo para poder viajar. Podemos volver con el yak a la puerta y confiar en que los mogu no nos vean pasar.\n\nAvísame cuando estés $glisto:lista; para partir.', '', '', '', '', '', '', 33528),
(57072, 'esES', 'Yaktótum', 'Busca algo que te ayude a llevarle la cerveza a Chen, que está en Mogujia.', '<Hay demasiados barriles de cerveza y pesan demasiado como para llevarlos por tu cuenta.\n\nTal vez deberías buscar algo o a alguien que te ayude>.', '', '', '', '', '', '', 33528),
(57071, 'esES', 'No dejaremos cerveza atrás', 'Localiza los barriles de cerveza abandonados en la Cima Kun-Lai.', 'Cómo me duele... la cabeza. Solo hay un remedio.\n\nAntes sobrevolamos una caravana de cerveza abandonada. ¡Tienes que ir a buscarla y rescatar esa cerveza! Eso debería hacerme recobrar las fuerzas.\n\nY además, haría maravillas por la moral de los que luchan en el valle.', '', '', '', '', '', 'Localiza los barriles de cerveza abandonados en la Cima Kun-Lai.', 33528),
(57070, 'esES', 'Masacre mogu', 'Mata mogu en la Cima Kun-Lai.', 'Creo que esto es lo que mis amigos llamarían un \"entorno rico en objetivos\", que es otra forma de decir que estamos rodeados y probablemente sea nuestro fin.\n\nYa sabes qué significa eso. ¡Tenemos que matar a todos los mogu que podamos! Da igual cómo, ¡tú cárgatelos!', '', '', '', '', '', '', 33528),
(57069, 'esES', 'Cortar cabezas', 'Mata a los comandantes mogu.', 'Vale. Estamos atrapados en medio de tres ejércitos mogu, y el tío Chen no puede moverse.\n\nPero no todo está perdido. Tenemos la posibilidad de eliminar a los líderes de cada uno de los ejércitos. ¡Tal vez eso los frene o los distraiga el tiempo suficiente para que podamos volver a la puerta!\n\nA ver si puedes salir y cargarte a los mogu más grandes y terroríficos que veas. Esos serán los comandantes.', '', '', '', '', '', '', 33528),
(57068, 'esES', 'Reconocimiento en cometa', 'Monta en la cometa de Chen para examinar los ejércitos mogu.', 'Ya oímos que había un ataque de los mogu, ¡pero no tenía ni idea de que serían tantos!\n\nTiene que haber un modo de detenerlos antes de que invadan el valle del todo. Deprisa, sobrevolemos la zona para ver cuántos son.\n\nTenemos una cometa que puede llevar a tres personas. Normalmente son más, pero me he pegado un buen almuerzo.', '', '', '', '', '', '', 33528),
(57067, 'esES', 'Mogu a las puertas', 'Reúnete con Chen y Li Li Cerveza de Trueno en la Puerta de los Augustos Celestiales.', 'Ha llegado la hora. Los otros clanes mogu tienen la vista puesta en el Valle de la Flor Eterna.\n\nNo lo conquistarán.\n\nAlgunos de los tuyos han ido ya a la puerta a determinar el tamaño de sus fuerzas. Si te consideras $gdigno:digna; de una misión de este calibre, reúnete allí con ellos.', '', '', '', '', '', 'Reúnete con Chen y Li Li Cerveza de Trueno en la Puerta de los Augustos Celestiales.', 33528),
(57059, 'esES', '¡A pelear!', 'Derrota a $1oa malandrines a sueldo.', '¡Mal asunto, $n! ¡Muy mal asunto!\n\nGallywix y sus matones me están destrozando el taller, pero lo lleva claro si cree que le voy a entregar la armadura personal X-52.\n\nTienes que ir hasta allí y eliminar a su banda de matones antes de que el sitio quede reducido a cenizas, ¡y con él TODOS MIS INVENTOS!', '', '', '', '', '', '', 33528),
(57058, 'esES', 'Diversión con minas', 'Hazte con la refrescante bebida de coco en el campo de minas.', '¡El prototipo de armadura personal X-52 está listo para la prueba final!\n\n¿Cómo llevas lo de los ruidos fuertes y las ráfagas repentinas de energía de conmoción, $n?\n\nEn esta última prueba, vamos a colocarte la armadura personal X-52 para que atravieses un campo de minas.\n\nEn el centro de dicho campo he puesto una refrescante bebida de coco. ¡Considérala una merecida recompensa por llegar hasta el oasis y sobrevivir a las inevitables explosiones que se producirán!', '', '', '', '', '', '', 33528),
(57053, 'esES', 'Prueba de fuerza contundente', 'Completa el experimento de Hobart Martillazos.', 'Ahora que tenemos los termoenchufes, estamos listos para la siguiente prueba del prototipo de armadura personal X-52.\n\nPor desgracia, mis ayudantes de laboratorio han abandonado o han expirado. ¡Qué lástima! Pero ellos se lo pierden, $n... ¡Porque ahora TÚ puedes ponerte la armadura personal X-52!\n\n¡Qué emoción!\n\nLa siguiente prueba la llevará a cabo mi nuevo ayudante de laboratorio mecanizado. Dirígete al taller principal y pulsa el gran botón rojo para empezar.\n\n¡Descuida, que yo te iré dando instrucciones por el intercomunicador incorporado de la X-52!', '', '', '', '', '', '', 33528),
(57052, 'esES', 'Tengo lo que necesitas', 'Entrégale el paquete a Hobart Martillazos.', 'Un trato es un trato, $n. ¡Aquí tienes los termoenchufes que querías!\n\nProcura que ese viejo gruñón de Martillazos sepa que no le voy a regalar nada más. Si necesita más termoenchufes, más le vale estar dispuesto a apoquinar.\n\nEn fin, ha sido un placer hacer negocios contigo...\n\n¡Y ahora piérdete!', '', '', '', '', '', '', 33528),
(57051, 'esES', '¡Cobro de deudas!', 'Cobra $1oa deudas impagadas.', '¿Necesitas termoenchufes? Pues has venido al lugar adecuado, $gchico:chica;.\n\nPero no pienso fiártelos. Ya me deben dinero demasiados jetas. Estoy con el agua al cuello, si no me pagan enseguida tendré que cerrar pronto.\n\n<Crank Mechagrasa se queda pensando un instante>.\n\nOye, ¿sabes qué? Si logras obligar a esos inútiles a que me paguen lo que me deben, te daré los termoenchufes a cambio.\n\n¡No encontrarás una oferta mejor!', '', '', '', '', '', '', 33528),
(57049, 'esES', 'Cámara de almas', '', '', '', '', '', '', '', '', 33528),
(57048, 'esES', 'Comprar piezas', 'Habla con Crank Mechagrasa.', 'Para completar la siguiente fase de las pruebas, me harán falta unos cuantos componentes más.\n\nAhora mismo, lo que más necesitamos son termoenchufes y adaptadores para termoenchufes. Ya te explicaré luego para qué son...\n\nCrank Mechagrasa tiene una tienda cerca de la entrada de la ciudad. Ve a hablar con él y dile que te suelte las piezas necesarias.\n\nMe da igual lo que cuesten, ¡dile que ya se lo pagaré! Ahora mismo no estoy para regateos. ¡Debo preparar las modificaciones de la armadura personal X-52!', '', '', '', '', '', '', 33528),
(57047, 'esES', 'Un sencillo experimento', 'Ayuda a Hobart Martillazos.', 'Ahora que has entregado las piezas necesarias, por fin puedo empezar a probar mi último prototipo.\n\n¡Lo llamo la armadura personal X-52! ¡Será casi indestructible!\n\nGallywix siempre ha codiciado mis inventos, y ahora que sabe lo de la X-52, seguro que no trama nada bueno. ¡Debo completar el prototipo antes de que a Gallywix se le ocurra un modo de afanármelo!\n\nMe vendrían muy bien un par de manos más con los experimentos.\n\n¿Puedo contar contigo, $n?', '', '', '', '', '', '', 33528),
(57045, 'esES', 'Una entrega especial', 'Entrégale el paquete a Hobart Martillazos.', 'Me alegra que al fin estés aquí, $n. Tengo que hacer una entrega importante y tú eres de quien más me fío.\n\nYa, ya, sé que no es mucho decir, ¡pero hoy en día no es fácil encontrar a gente válida!\n\nEste paquete es para Hobart Martillazos. Tiene un taller en Villaescoria y necesito que se lo entregues. ¡Está trabajando en algo gordo!\n\nEntrega el paquete y, por lo que más quieras... ¡QUE NO SE TE CAIGA!\n\n¡Ni te imaginas lo que me costó localizar este trasto!', '', '', '', '', '', '', 33528),
(57043, 'esES', 'Viejos amigos, nuevas oportunidades', 'Habla con Sassy Malallave, que está en la Vega de Tuercespina.', '¡Pero si es $n! ¡Eres justo $gel:la; goblin que estaba buscando!\n\nHa pasado mucho tiempo desde lo de Kezan, ¿eh? ¡Qué bien lo pasamos tú y yo por ahí en aquella época!\n\nBueno, no quiero ponerme sentimental, pero Sassy Malallave me envía a buscarte. ¡Está reuniendo a la banda para un asunto gordo! ¡Gordísimo!\n\nMira, ojalá tuviera más tiempo para ponernos al día, pero hay que irse. El tiempo es oro, ¿sabes?\n\nSi quieres participar, busca a Sassy. Ella te dará los detalles.', '', '', '', '', '', '', 33528),
(57039, 'esES', 'Valle de los Espíritus', '', '', '', '', '', '', '', '', 33528),
(57023, 'esES', 'Artefacto mogu pesado', '', '', '', '', '', '', '', '', 33528),
(57022, 'esES', 'Asalto: Avance amathet', '', '', '', '', '', '', '', '', 33528),
(57008, 'esES', 'Asalto: Clanes enfrentados', 'Rechaza el ataque mogu en el Valle de la Flor Eterna.', 'Esos oportunistas clanes mogu quieren apoderarse del valle mientras sus defensores se recuperan del ataque de N\'Zoth.\n\nSon tan cobardes como insensatos.\n\nDemuéstrales lo equivocados que están.', 'Vuelve con el hablatormentas Qian, que está en El Santuario Silente.', '', '', '', '', 'Vuelve con el hablatormentas Qian, que está en El Santuario Silente.', 33528),
(57001, 'esES', 'Valle del Honor', '', '', '', '', '', '', '', '', 33528),
(56906, 'esES', 'Corona de buena fortuna', 'Recolecta flores de Cuna del Invierno, Dun Morogh y las Laderas de Trabalomas.', '¡Esas flores me recuerdan a la propia Elune! Yo llevo unas parecidas todo el año para tener presente su gracia protectora.\n\n¿No te gustaría hacer lo mismo?\n\nTu corona se compone de flores corrientes que un día se marchitarán y morirán. Es un destino lamentable para tan delicadas bellezas. ¡Mi corona está hecha de flores similares, pero las he bendecido para que duren todo el año! Si me traes unas flores específicas que florecen solo durante el Festival Lunar, las bendeciré para que tú también puedas disfrutar de tu corona todo el año.', '', '', '', '', '', 'Vuelve con Myrael Florlunar, que está en el Claro de la Luna.', 33528),
(56905, 'esES', 'Corona de flores oscuras', 'Reúne flores del Bosque del Ocaso, el Bosque de Argénteos y Desolace.', 'Qué flores tan sombrías... Pero tienen una belleza particular, ¿no crees? Ojalá no se marchitaran.\n\nPermite que te preste mi ayuda.\n\nEn cada Festival Lunar crecen flores parecidas a las tuyas en todo el mundo. Tienen una conexión especial con Elune... que yo puedo potenciar. Si me las traes, las preservaré para que puedas disfrutarlas durante mucho más de lo normal.', '', '', '', '', '', 'Vuelve con Myrael Florlunar, que está en el Claro de la Luna.', 33528),
(56904, 'esES', 'Corona de prosperidad', 'Reúne flores del Cráter de Un\'Goro, la Vega de Tuercespina y Los Baldíos del Norte.', '¡Qué colorida es tu corona! Qué bonitos esos tonos rosas, amarillos y azules... Ojalá no se marchitaran.\n\n¡Estas se marchitarán, pero sé de unas que no lo harán!\n\nEn cada Festival Lunar brotan flores como esas. Tienen una conexión especial con Elune que yo puedo potenciar. ¡Consíguemelas y haremos una corona que podrás disfrutar todo el año!', '', '', '', '', '', 'Vuelve con Myrael Florlunar, que está en el Claro de la Luna.', 33528),
(56903, 'esES', 'Corona de coraje', 'Recolecta flores del Bosque Canción Eterna, las Tierras del Interior y Mulgore.', 'Veo que te gustan las flores rosas. Es una pena que las de tu corona acaben marchitándose.\n\nTal vez yo pueda ayudarte con eso.\n\nAunque esas flores son corrientes, conozco unas parecidas que brotan solo durante el Festival Lunar. Si me las traes, las imbuiré del poder de Elune para que puedas disfrutarlas todo el año.', '', '', '', '', '', 'Vuelve con Myrael Florlunar, que está en el Claro de la Luna.', 33528),
(56889, 'esES', 'Vagayermos heridos', 'Sana a $1oa obreros Vagayermos.', 'Ah, $gamigo mío:amiga mía;, ¿has vuelto para prestar más ayuda?\n\nComo puedes ver, seguimos enzarzados con esas criaturas, cuya cifra no hay modo de reducir.\n\nEs una guerra de desgaste, y estamos en clara desventaja porque nuestras bajas no paran de aumentar.\n\nPor favor, ayuda a los heridos que encuentres en las ruinas.', '', '', '', '', '', '', 33528),
(56771, 'esES', 'Guerreros perdidos en el tiempo', 'Reúnete con los rajani en El Santuario Silente.', 'Según el informe de exploración que encontraste, los rajani se esconden en El Santuario Silente, que domina sobre la Aldea Bruma Otoñal.\n\nEn el informe se los describe como aislados y peligrosos, así que más nos vale ir con cuidado cuando los abordemos.\n\nTe veré allí.', '', '', '', '', '', '', 33528),
(56751, 'esES', 'Requisa de Pernoóxido: hueso calcificado', 'Llévale $1oa de mena de plata de tormenta a Gila Cruzacables.', '', '', '', '', '', '', '', 33528),
(56750, 'esES', 'Requisa de Pernoóxido: hueso calcificado', 'Llévale $1oa de mena de plata de tormenta a Skaggit.', '', '', '', '', '', '', '', 33528),
(56647, 'esES', 'La amenaza mántide', 'Vuelve con el hablatormentas Qian, que está en El Santuario Silente.', 'Los mántides han estado corrompiendo sus árboles kypari para imbuir su ámbar con el poder de N\'Zoth. El enjambre ya es una amenaza de por sí. N\'Zoth podría transformarlos en algo aún más terrible.\n\nEsto hay que contárselo al Shadopan. Te recomiendo que informes también a tus demás aliados.', '', '', '', '', '', 'Vuelve con el hablatormentas Qian, que está en El Santuario Silente.', 33528),
(56645, 'esES', 'Corazón del enjambre', 'Vuela con Taoshi en la cometa del Shadopan.', 'Necesitamos saber a qué nos enfrentamos. Antes de volver al Espinazo del Dragón, tendríamos que aprovechar para observar al enjambre.\n\nSobrevolaremos el Corazón del Miedo. Desde arriba deberíamos poder inspeccionar las fuerzas de la emperatriz Shek\'zara. Así podremos determinar hasta qué punto ha reforzado N\'Zoth sus filas.', '', '', '', '', '', '', 33528),
(56617, 'esES', 'Un enjambre unido', 'Infíltrate en Klaxxi\'vess.', 'Parecía que los mántides llevaran ya algún tiempo produciendo el ámbar corrupto antes de nuestra... intervención. Sería lógico que tuvieran una reserva en algún lugar.\n\nLos exploradores del Shadopan han estado informando de la presencia creciente de guerreros del enjambre en Klaxxi\'vess. Apuesto a que custodian el ámbar corrupto.\n\nReúnete conmigo allí. Si tenemos la oportunidad de destruir ese ámbar, debemos aprovecharla.', '', '', '', '', '', '', 33528),
(56616, 'esES', 'Caras conocidas, problemas nuevos', 'Mata al vigía Vl\'thax.', 'Uno de los esbirros de N\'Zoth parece haberse percatado de nuestra presencia.\n\n¿Le hacemos una visita?', '', '', '', '', '', '', 33528),
(56580, 'esES', 'Secretos de ámbar', 'Reúne $1oa trozos de ámbar corrupto.', 'La Cámara del Mañana alberga una pequeña sección de los Zara\'thik, mántides a las órdenes directas de la nueva emperatriz. Puede que algunos hayan recibido trozos de ámbar como el que encontraste.\n\nAl Shadopan le interesarían todos los trozos de más que pudiéramos conseguir.', '', '', '', '', '', '', 33528),
(56578, 'esES', 'Podredumbre arraigada', 'Pon freno al origen de la corrupción en la Cámara del Mañana.', 'Debajo de Kypari Kor hay una gran cámara donde los mántides cuidan del árbol. Esa debe de ser la fuente de su corrupción.\n\nTenemos que entrar ahí y detenerlos. No podemos permitir que N\'Zoth potencie al enjambre.', '', '', '', '', '', '', 33528),
(56577, 'esES', 'Entorpecer al enjambre', 'Mata a $1oa mántides Kor\'thik en Kor\'vess.', 'Estos mántides trabajan febrilmente para recolectar ámbar del árbol.\n\nTal vez si matas a unos cuantos bajen el ritmo.', '', '', '', '', '', '', 33528),
(56576, 'esES', 'Exterminación de aqir', 'Mata a $1oa empaladores aqir.', 'Hay demasiadas de esas cosas revoloteando por aquí como para que podamos escapar inadvertidamente.\n\n¡Lo más probable es que se nos echen encima en cuanto arranquemos los motores!\n\nEsos bichos van a ir directos a tierra de una forma u otra... ¿Por qué no acelerar el proceso, eh?', '', '', '', '', '', '', 33528),
(56575, 'esES', 'Una vez más en Kor\'vess', 'Investiga Kor\'vess.', '¿Esto lo tenía un miembro del enjambre? Desprende corrupción... y poder. Podríamos enfrentarnos a una grave amenaza si el resto del ámbar de los mántides está igual de corrupto.\n\nHacia el oeste, en el Desierto del Pavor, se halla Kor\'vess, un gran árbol kypari que proporciona al enjambre una buena parte de su ámbar. Desde allí podemos determinar cuántas de sus reservas han sido imbuidas de la energía de los dioses antiguos.\n\nMe reuniré contigo cerca del árbol.', '', '', '', '', '', '', 33528),
(56574, 'esES', 'Reflejos en el ámbar', 'Lleva el ámbar cubierto de moco a los Shadopan, que están en el Espinazo del Dragón.', '<Un moco oscuro y viscoso gotea de este gran trozo de ámbar. Los intentos de limpiarlo no sirven de nada, ya que el moco parece provenir del ámbar en sí.\n\nAl sostenerlo, unos susurros ininteligibles suenan de forma subconsciente en tu cabeza.\n\nSeguro que los Shadopan querrán examinarlo>.', '', '', '', '', '', 'Lleva el ámbar cubierto de moco a los Shadopan, que están en el Espinazo del Dragón.', 33528),
(56550, 'esES', 'De vuelta a la tumba', 'Quema $1oa cadáveres con huevos.', 'Nuestros amigos siguen cayendo por culpa de esos terribles insectos que no paran de salir de sus nidos y de atacar nuestros campamentos.\n\nEs terrible tener que pedir esto, pero debemos deshacernos de los cadáveres lo antes posible.\n\nNo podemos permitir que nuestros muertos sirvan de fertilizante para que crezcan sus repugnantes huevos.', '', '', '', '', '', '', 33528),
(56542, 'esES', 'Esperanza restaurada', 'Habla con Ra Den para regresar a la Cámara del Corazón.', 'Tu perseverancia alimenta mi esperanza en este mundo.\n\nRegresemos a tu \"Cámara del Corazón\". Como custodio de la Forja de los Orígenes, creo que puedo ayudarte a restablecerla.\n\nHabla conmigo cuando estés $glisto:lista; y nos dirigiremos allí.', '', '', '', '', '', '', 33528),
(56541, 'esES', 'El Motor de Nalak\'sha', 'Sigue el pasadizo secreto del Palacio Mogu\'shan y reactiva el Motor de Nalak\'sha.', 'Ya me he equivocado antes con los tuyos, así que me arriesgaré a hacerlo también contigo.\n\nLa construcción de los titanes que alberga el Motor de Nalak\'sha abarca toda Pandaria. No solo se puede llegar a ella mediante las Cámaras Mogu\'shan.\n\nHay muchas rutas similares, pero la más cercana sería a través del Palacio Mogu\'shan. Las salas de debajo del palacio conectan con las cámaras.\n\nBusca allí tu destino, adalid.', '', '', '', '', '', '', 33528),
(56540, 'esES', 'Muestra de tenacidad', 'Obtén un trofeo del conquistador de un comandante en un asalto en el Valle de la Flor Eterna.', 'Si tan convencido está el alto centinela de que no tenemos ninguna posibilidad, tal vez una demostración de fuerza lo haga cambiar de opinión.\n\nNo sé cómo te las podrías apañar, pero si trajeras pruebas de tu victoria contra los que amenazan el valle, podrían convencerle de que hay que hacer algo.', '', '', '', '', '', '', 33528),
(56539, 'esES', 'Localizar a los rajani', 'Consigue un informe de exploración mogu en el Valle de la Flor Eterna.', 'Ahora que tenemos una idea de a quién buscamos, la siguiente cuestión es dónde encontrarlo.\n\nCon las constantes luchas internas de los mogu, es probable que cada uno de los clanes esté al tanto de la ubicación de sus competidores. Si encontramos esa información, puede que nos lleve hasta los rajani.\n\nBusca a los campeones de los mogu. Serán ellos quienes lleven encima los informes sobre el paradero de sus enemigos.', '', '', '', '', '', '', 33528),
(56538, 'esES', 'Clanes de los mogu', 'Ayuda al eremita Cho, que está en el Trono del Saber, a descubrir el origen del sigilo mogu misterioso.', '¿Dices que un mogu te pidió ayuda? Eso es algo insólito.\n\nMe encantaría ayudarte a averiguar los orígenes de este sigilo. Para ser sincero, la idea de un clan mogu que no sea abiertamente hostil me interesa muchísimo. ¡Imagina las posibilidades!\n\nPongámonos manos a la obra. Habrá que consultar los volúmenes sobre los diversos clanes mogu del valle para ir descartando.', '', '', '', '', '', '', 33528),
(56537, 'esES', 'El sigilo misterioso', 'Llévale el sigilo mogu misterioso al eremita Cho en el Trono del Saber, que está en el Valle de la Flor Eterna.', '<El mogu muerto tiene agarrado un sigilo, un símbolo del misterioso clan al que pertenece.\n\nSi pudieras rastrear a su clan, tal vez ellos sepan algo más acerca de la invasión mántide de las Cámaras Mogu\'shan y de cómo vencerlos.\n\nDe todos es bien sabido que el eremita Cho es muy versado en Pandaria. Quizás él pueda ubicar los orígenes del sigilo del mogu>.', '', '', '', '', '', '', 33528),
(56536, 'esES', 'Nunca resulta fácil', 'Reúnete con Magni Barbabronce frente a las Cámaras Mogu\'shan, que están en la Cima Kun-Lai.', 'Que yo sepa, las Cámaras Mogu\'shan siguen abandonadas.\n\nNo debería costarnos demasiado llegar al motor, puesto que ya hemos derrotado a los guardias mogu de ese lugar.\n\nBueno, ¿a qué esperas? ¡Encendamos ese motor!', '', '', '', '', '', '', 33528),
(56472, 'esES', 'El acuerdo de Uldum', 'Averigua más información acerca de las amenazas a las que se enfrenta Uldum en Ramkahen.', '¿Buscas ayuda para defender la Forja de los Orígenes? Parece que nuestros objetivos coinciden.\n\nLas Cámaras de los Orígenes no son sino una pequeña parte de la auténtica magnitud de la forja. Cualquier amenaza para Uldum sería una amenaza potencial para la forja, y a Uldum le han salido últimamente muchos enemigos.\n\nÍbamos a convocar al Alto Consejo cuando esos Vagayermos llegaron de improviso. ¿Te unirías a nosotros para averiguar más sobre esas amenazas?', '', '', '', '', '', '', 33528),
(56402, 'esES', 'Monedas Vagayermos', 'Consigue $1oa monedas Vagayermos.', 'Puede que sea demasiado tarde para algunos de nuestros hermanos y hermanas, pero nunca lo es para dar consuelo a sus familias.\n\nCada Vagayermos lleva encima una moneda única que simboliza su rango en nuestro grupo.\n\nSi encuentras algunas de esas monedas, tráemelas y me aseguraré de que se las entreguen a sus familiares.', '', '', '', '', '', '', 33528),
(56391, 'esES', 'Dientefaca frenético', '', '', '', '', '', '', '', '', 33528),
(56377, 'esES', 'A forjar', 'Vuelve con Magni Barbabronce, que está en la Cámara del Corazón, y descubre qué ha pasado con la Forja de los Orígenes.', 'Gracias por ayudarme en la forja. Da rabia que N\'Zoth haya podido infiltrarse tan rápido, ¡pero al menos llegamos a tiempo de evitar que se la cargaran por completo!\n\nAhora toca intentar recuperarla del todo. MADRE ha estado trabajando en una solución, y creo que tenemos un plan.', '', '', '', '', '', '', 33528),
(56376, 'esES', 'Amenazas incipientes', 'Completa un asalto en Uldum.', 'Para los tol\'vir, proteger los ensamblajes de los titanes aquí en Uldum es un deber sagrado. Sin embargo, ahora somos menos, y las amenazas a las que nos enfrentamos son mayores cada día.\n\nAun con la fuerza de nuestros nuevos aliados, no podremos contener mucho tiempo a esos enemigos. Si alguno de ellos aumentara su poder, podrían arrollarnos y poner en peligro la forja. Por eso te necesitamos.\n\nHabla con el alto comandante Kamses para evaluar la situación.', '', '', '', '', '', '', 33528),
(56375, 'esES', 'Hacia Ramkahen', 'Reúnete con el rey Phaoris en Ramkahen.', 'Por lo visto habrá que esperar un poco a que MADRE decida qué hacer con la forja. Mientras tanto, tendremos que asegurarnos de que nadie intente hacer más daño aquí.\n\nDeberías ir a ver a los tol\'vir de Ramkahen. Me consta que ya les echaste una mano antes, así que tal vez nos ayuden a impedir que la forja caiga en malas manos.', '', '', '', '', '', '', 33528),
(56374, 'esES', 'Un problema titánico', 'Reúnete con Magni Barbabronce en las Cámaras de los Orígenes, que están en Uldum.', 'No hay tiempo que perder.\n\nSin la Forja de los Orígenes, Azeroth es vulnerable a la corrupción de N\'Zoth. ¡Por no mencionar que contiene un arma capaz de aniquilar toda la vida en Azeroth!\n\nTenemos que ir a la forja ya mismo. MADRE se quedará a cargo de todo aquí.\n\nDate prisa, nos veremos allí.', '', '', '', '', '', '', 33528),
(56308, 'esES', 'Asalto: Aqir desenterrados', 'Rechaza el asalto aqir en Uldum.', 'Están invadiendo nuestra posición. ¡Los aqir llegan en cantidades nunca vistas!\n\nNo sé cuánto tiempo podremos aguantar. ¡Tenemos que hacerlos retroceder!', 'Vuelve con Arik Escorpijón, que está en el Obelisco de la Luna.', '', '', '', '', 'Vuelve con Arik Escorpijón, que está en el Obelisco de la Luna.', 33528),
(56209, 'esES', 'Las Cámaras de los Orígenes', 'Derrota a las fuerzas amathet y reactiva la forja de las Cámaras de los Orígenes.', 'Parece que las Cámaras de los Orígenes han caído en manos de un grupo de tol\'vir que se hacen llamar amathet. No sé mucho de ellos, aparte de que son nuevos aquí y no muy amistosos.\n\n¡Tenemos que entrar ahí a reactivar la forja o será el fin de Azeroth!', '', '', '', '', '', '', 33528),
