(56076, 'esES', 'Ritual abisal', '', '', '', '', '', '', '', '', 33528),
(56075, 'esES', 'Poder robado', 'Consigue $1oa pergaminos de Shirakess.', 'Estos nagas extraen su fuerza del Vacío.\n\nCada pergamino que elaboran es conocimiento compartido, y ese conocimiento es poder.\n\nPor lo tanto, si les robamos el conocimiento, también les arrebatamos el poder.\n\n¡Mi lógica no será la mejor del mundo, pero hagámoslo de todas formas!', '', '', '', '', '', '', 33528),
(56074, 'esES', 'Conducto del Vacío', '', '', '', '', '', '', '', '', 33528),
(56064, 'esES', 'Asalto: El Imperio Negro', 'Rechaza el asalto de N\'Zoth en el Valle de la Flor Eterna.', 'No me lo puedo creer. ¡El Imperio Negro se está materializando justo aquí en el valle!\n\n¡Debemos pasar a la acción!', 'Vuelve con el eremita Cho, que está en el Trono del Saber.', '', '', '', '', 'Vuelve con el eremita Cho, que está en el Trono del Saber.', 33528),
(56013, 'esES', 'Cofre con bloqueo de runas', '', '', '', '', '', '', '', '', 33528),
(56011, 'esES', 'Cofre con bloqueo de runas', '', '', '', '', '', '', '', '', 33528),
(56010, 'esES', 'Cofre con bloqueo de runas', '', '', '', '', '', '', '', '', 33528),
(56006, 'esES', 'Cofre con bloqueo de runas', '', '', '', '', '', '', '', '', 33528),
