(55655, 'esES', 'Misión de rastreo', '', '', '', '', '', '', '', '', 33528),
(55640, 'esES', 'Visión de Ventormenta', 'Completa la Visión de Ventormenta.', 'Debilita a N\'Zoth adentrándote en su mente.', '', '', '', '', '', '', 33528),
(55614, 'esES', 'Misión de rastreo', '', '', '', '', '', '', '', '', 33528),
