(55466, 'esES', 'Vuk\'laz el Rompesuelos', '', '', '', '', '', '', '', '', 33528),
(55381, 'esES', 'Requisa de Pernoóxido: mena de plata de tormenta', 'Llévale $1oa de mena de plata de tormenta a Skaggit.', '', '', '', '', '', '', '', 33528),
(55380, 'esES', 'Requisa de Pernoóxido: mena de plata de tormenta', 'Llévale $1oa de mena de plata de tormenta a Gila Cruzacables.', '', '', '', '', '', '', '', 33528),
