(55354, 'esES', 'El frente de Vir\'nall', '', '', '', '', '', '', '', '', 33528),
(55350, 'esES', 'Asalto: Avance amathet', 'Rechaza el asalto amathet en Uldum.', 'Los amathet pretenden apoderarse de la Forja de los Orígenes. ¡No debemos permitir que vuelva a caer en sus manos!\n\nNuestros hombres defienden la entrada, pero los arrollarán si todo el poderío de los amathet cae sobre ellos.\n\nHaz lo que puedas para derrotarlos antes de que sea demasiado tarde.', 'Vuelve con el alto comandante Kamses, que está en Ramkahen.', '', '', '', '', 'Vuelve con el alto comandante Kamses, que está en Ramkahen.', 33528),
(55036, 'esES', 'Un lugar terrible', 'Completa una visión de N\'Zoth.', 'Tal vez te hayas fijado en las perturbaciones que están teniendo lugar en Azeroth. El dios antiguo se está alzando, y eso son malas noticias para todos nosotros.\n\nEn ocasiones aparece un pilar de la verdad eterna. Un nombre fantástico, ¿no crees? Se me da bien lo de poner nombres.\n\n¿Qué estaba diciendo? Ah, sí, ya. Estos pilares permiten acceder a la mente del propio dios antiguo. Te dejan entrever lo que podría venir y cómo sería este mundo si no lográramos derrotarlo.\n\n¿Quieres verlo por ti $gmismo:misma;?', '', '', '', '', '', '', 33528),
(54990, 'esES', 'La nueva guardia', 'Reúnete con Tess Cringrís en el Castillo de Ventormenta.', 'Necesito volver a hablar con mis padres. Creo que mi padre y yo tenemos que aclarar algo.\n\nReúnete conmigo en el Castillo de Ventormenta. Me gustaría darte las gracias de un modo más formal.', '', '', '', '', '', '', 33528),
(54984, 'esES', 'Que los lobos sigan durmiendo', 'Usa el portal onírico y guía a Tess.', 'La esencia de Tess deambula ahora por una parte del Sueño Esmeralda que he enlazado con sus pensamientos. Y le he dado mi don, pero aun así le vendría bien que la guiaran.\n\nEntra en el Sueño por el portal que hay a mi espalda y saldrás cerca de donde ella duerme. Haz lo posible para que vea que la ira puede cegar a un mortal.', '', '', '', '', '', '', 33528),
(54983, 'esES', 'Despertar a un soñador', 'Defiende a Vassandra Garratormenta mientras invoca a Goldrinn.', 'Con esto debería bastar para invocar al ancestro.\n\nPero puede que otros visitantes no deseados respondan antes a la llamada. ¡Protégeme mientras realizo el ritual!', '', '', '', '', '', '', 33528),
(54982, 'esES', 'El espíritu del cazador', 'Hazte con los colmillos de los lobos Colminébula.', 'Otra cosa que tal vez necesite para este ritual son unos colmillos de lobo.\n\nHay una manada nueva que se acaba de instalar en torno a la Mansión Mantoniebla. Tráeme sus colmillos. Te estaré esperando en la Arboleda del Crepúsculo.', '', '', '', '', '', 'Reúnete con Vassandra Garratormenta en la Arboleda del Crepúsculo.', 33528),
(54981, 'esES', 'Aullar a la luna', 'Recoge una flor de la Gracia de Elune.', 'El Bosque del Ocaso tiene una conexión directa con el Sueño Esmeralda. Puede que mediante ella pueda invocar al ancestro Goldrinn. Él podrá hacer que la princesa pruebe la maldición que con tanto riesgo persigue.\n\nEn la parte oriental del bosque crece una flor muy poco habitual: recógela y ven a verme a la Arboleda del Crepúsculo. Me servirá para el ritual.', '', '', '', '', '', 'Reúnete con Vassandra Garratormenta en la Arboleda del Crepúsculo.', 33528),
(54980, 'esES', 'Azote de los Penumbría', 'Subyuga a Sangrojos y regresa con ella al Cerro del Cuervo.', 'La princesa Cringrís me ha informado de la situación, y creo que sé cómo puedo ayudar.\n\nPero antes, favor con favor se paga. Los habitantes del Bosque del Ocaso sufren desde hace algún tiempo a una integrante especialmente feroz de la manada Penumbría a la que llaman \"Sangrojos\". Toma el sedante del maestro Harris y tráeme viva a la huargen. Será una cobaya perfecta para probar curas.', '', '', '', '', '', '', 33528),
(54977, 'esES', 'Hacia el Bosque del Ocaso', 'Habla con Vassandra Garratormenta en el Bosque del Ocaso.', 'En Teldrassil conocí a una elfa de la noche, Vassandra Garratormenta, que tal vez pueda enseñar a Tess sin recurrir a medidas tan extremas. Fue ella quien ayudó a nuestra gente en su momento de aflicción.\n\nVassandra se encuentra ahora en el Bosque del Ocaso, ayudando a los habitantes del Cerro del Cuervo a intentar curar a los huargen ferales de la zona. Si alguien es experta en la maldición, es ella.\n\nY si puedo pedirte algo más personal, no dejes que mi hija cometa ninguna insensatez. En eso se parece mucho a su padre.', '', '', '', '', '', '', 33528),
(54976, 'esES', 'La sombra de Gilneas', 'Reúnete con Tess Cringrís en el Castillo de Ventormenta.', '¡Adalid de Gilneas!\n\nTengo una carta para ti de la princesa Tess Cringrís, que solicita tu presencia en el Castillo de Ventormenta.', '', '', '', '', '', '', 33528),
(54680, 'esES', 'Maestro de peste Herbert', '', '', '', '', '', '', '', '', 33528),
(54590, 'esES', 'Picoíra', '', '', '', '', '', '', '', '', 33528),
(54568, 'esES', 'Señor de las ramas Aldrus', '', '', '', '', '', '', '', '', 33528),
(54553, 'esES', 'Kor\'gresh Ira Helada', '', '', '', '', '', '', '', '', 33528),
(54549, 'esES', 'Kovork', '', '', '', '', '', '', '', '', 33528),
(54468, 'esES', 'Nalaess Buscaplumas', '', '', '', '', '', '', '', '', 33528),
(54036, 'esES', 'Un proceso especial', 'Habla con Nomi.', 'Como tal vez hayas observado, el vinatero Iltheux es muy maniático con su proceso de elaboración, pero cuando creó su antigua receta solo tuvo en cuenta a los Nocheterna.\n\n¡Para satisfacer los diversos paladares de la Horda, necesitamos algo distinto!\n\nHabla con Nomi y averigua qué tiene en mente.', '', '', '', '', '', '', 33528),
(54027, 'esES', 'Amenaza contenida', 'Reúnete con la guardafilada Sonji en el Fuerte Grommash, que está en Orgrimmar.', '¡Eso mantendrá a los nagas tranquilitos!\n\nY vas a tener el honor de informar a la guardafilada Sonji de que la amenaza contra las costas de Zuldazar está bajo control.', '', '', '', '', '', '', 33528),
(54026, 'esES', 'Pues esto ya está', 'Reúnete con el comandante Dresh en el Fuerte Grommash, que está en Orgrimmar.', 'Me quedaré por aquí un poco más de tiempo para asegurarme de que los peones vuelvan al trabajo.\n\nTú deberías regresar a Orgrimmar e informar al comandante Dresh de que ya no tiene que preocuparse por la avanzada.', '', '', '', '', '', '', 33528),
(53908, 'esES', 'Espera nuestra llegada', 'Vuelve al Fuerte Grommash, que está en Orgrimmar.', 'Regresemos a Orgrimmar.\n\nSeguro que Kiro nos espera.\n\nNo deberíamos hacerle esperar.', '', '', '', '', '', '', 33528),
(53907, 'esES', 'Sorber y saborear', 'Entrega una muestra del vino de Nomi al vinatero Iltheux y consigue su aprobación.', '¡Creo que lo hemos conseguido, $p!\n\nVeamos si el vinatero aprueba nuestra cosecha.\n\nLlévale una muestra a Iltheux para ver qué le parece.', '', '', '', '', '', '', 33528),
(53906, 'esES', 'Fermentado por la Horda', 'Consigue los ingredientes necesarios para elaborar un vino digno de la Horda.', 'La receta del vinatero Iltheux no necesita grandes mejoras.\n\nTan solo hacen falta un par de ingredientes únicos y ciertas modificaciones en el proceso de elaboración del vino.\n\nCreo que la clave está en añadir flores de fuego fermentadas y luego filtrarlas con una tela especial hecha con fibras de alaseda.\n\nPor el viñedo deambulan muchas alasedas, y sin duda la jefa Mida podrá conseguir las flores, por un precio.', '', '', '', '', '', '', 33528),
(53905, 'esES', 'Sacar partido a sus capacidades', 'Asigna nuevos roles a Micah Anchapezuña, a la jefa Mida y a Nomi.', 'Iltheux no está empleando como es debido la ayuda que le han proporcionado.\n\nCorrijámoslo.\n\nAsigna a los trabajadores nuevas funciones más acordes a sus capacidades.\n\nSi necesitas sugerencias, te ayudaré encantada.', '', '', '', '', '', '', 33528),
(53904, 'esES', 'Los ayudantes del vinatero', 'Habla con Micah Anchapezuña, con la jefa Mida y con Nomi.', 'El vinatero Iltheux supervisa toda la producción de vino de arco para la Horda.\n\nEstá acostumbrado a elaborarlo él, pero la Horda le envió ayuda para acelerar el proceso.\n\nCosa que ha tenido el efecto inverso.\n\nTenemos que llegar al fondo del asunto.\n\n¿Y si te das una vuelta por los viñedos para ver cómo van las cosas? Tengo algunas preguntas más para el vinatero.', '', '', '', '', '', '', 33528),
(53903, 'esES', 'Encuentro con Meerah', 'Encuentra a Meerah en los Viñedos Crepusculares de Suramar.', 'Parece que vamos bien.\n\n¿Te importaría reunirte con Meerah?\n\nQuiero asegurarme de que ha conseguido encontrar al vinatero de Suramar.', '', '', '', '', '', '', 33528),
(53902, 'esES', 'Eliminar a la clamamareas', 'Mata a la clamamareas Nezara.', 'Puede que el escudo de Nezara haya caído, pero no por ello está indefensa.\n\nA su lado hay un bruto que puede causarnos problemas. Yo me encargo de él par que tú puedas liquidar a la clamamareas.', '', 'Líder de los nagas de Nazesh que invaden las costas de Zuldazar.', 'Clamamareas Nezara', '', '', '', 33528),
(53901, 'esES', 'Las explosiones nunca fallan', 'Coloca explosivos volátiles en los lanzaarpones de los nagas, y luego detónalos para crear una distracción.', 'La zona que rodea a la clamamareas Nezara está fuertemente vigilada, así que voy a necesitar que crees una distracción.\n\nToma estos explosivos y colócalos en los lanzaarpones de los nagas. Una vez detonados, la explosión deberá bastar para que los guardias salgan huyendo.', '', '', '', '', '', '', 33528),
(53900, 'esES', 'Usaremos sus armas', 'Consigue $1oa armas de Nazesh de las tropas que están en los Bajíos Perlatriste.', 'Necesitaremos armas especiales para abatir a la clamamareas Nezara. Suerte que los nagas parecen tener muchas.\n\nUsaremos sus armas en su contra. De eso tú y yo sabemos bastante.\n\nHazte con un buen surtido, necesitaremos unas cuantas.', '', '', '', '', '', '', 33528),
(53899, 'esES', 'En las afueras', 'Busca a Nisha en la costa sur de Zuldazar.', 'Si ya está todo arreglado con el comandante, deberías ir a ver a Nisha.\n\nSeguro que le vendrá bien tu ayuda.', '', '', '', '', '', '', 33528),
(53898, 'esES', 'Fuerza y honor', 'Enfréntate al supervisor Magrok y demuéstrale fuerza y honor.', 'A los peones se les ve contentos, ¿verdad? No tengo ninguna duda de que por la mañana regresarán al trabajo.\n\nPero si nadie planta cara a su líder, siempre habrá riesgo de revuelta.\n\nDebes enfrentarte a él en combate.\n\nDemuéstrale la verdadera fuerza de la Horda, pero también lo honroso que es mostrar clemencia.', '', 'Líder de la revuelta de los peones en Machacolpe.', '', '', '', '', 33528),
(53897, 'esES', 'Una fiesta en vuestro honor', 'Informa al supervisor Magrok de que la Horda va a organizar una fiesta en honor de los peones.', 'Creo que tengo todo lo necesario para que esta noche sea un éxito.\n\nSolo debemos asegurarnos de que los peones se presenten.\n\nDile a su líder que la Horda celebra una fiesta en su honor.\n\nNo creo que rechacen una noche de comida y bebida gratis.', '', '', '', '', '', '', 33528),
(53895, 'esES', '¡Ascensos para peones!', 'Asciende a unos cuantos peones Machacolpe de la Guarida de los Peones.', 'Simpatizo con la situación de los peones. Se les debería recompensar por el trabajo que realizan.\n\nDudo que la Horda acepte subirles el sueldo, pero no hay razón para no ascenderlos.\n\nCualquier otro título que no sea el de peón les ayudaría a ganar confianza.', '', '', '', '', '', '', 33528),
(53894, 'esES', 'Reparaciones útiles', 'Consigue $1oa de mena crepuscular para que Kiro pueda reparar las herramientas de los peones.', 'Los peones tienen razón. Estas herramientas son inaceptables.\n\n¿Cómo van a hacer su trabajo sin los instrumentos adecuados?\n\nYo puedo hacer las reparaciones necesarias, pero voy a necesitar algo de mena.', '', '', '', '', '', '', 33528),
(53893, 'esES', 'Un poco de buena voluntad', 'Consigue $1oa costillares de sable, $2oa trozos de carne de huargo y $3oa delicias de cloqueador.', 'Parece que los peones se sienten infravalorados. Realizan un trabajo importante para la Horda, pero su diligencia se suele pasar por alto. Un poco de buena voluntad ayudaría mucho.\n\nOrganicemos un festín en su honor. Necesitaremos bastante carne para saciar sus enormes apetitos, pero por suerte tengo un tótem que puede sernos útil.\n\nTú consigue los ingredientes y yo prepararé una comida que les levantará la moral.', '', '', '', '', '', '', 33528),
(53892, 'esES', '¿Dónde están los trabajadores?', 'Averigua adónde han ido los peones Machacolpe.', 'Mira esta hacha, $p. Aún hay sudor en la empuñadura. Hace muy poco que los trabajadores aún estaban aquí.\n\nA ver si Sasha consigue rastrear su olor.', '', '', '', '', '', '', 33528),
(53891, 'esES', 'No hay problema pequeño', 'Reúnete con Kiro en las Tierras Altas Crepusculares.', 'Puede que estos problemas parezcan menores, pero si nadie los aborda irán desgastando a la Horda.\n\nDebemos ofrecer nuestra ayuda.\n\nA los vulpera se nos da bien resolver todo tipo de problemas.\n\nIré a investigar la avanzada. Nisha y Meerah se ocuparán de los demás.\n\nReúnete conmigo en las Tierras Altas Crepusculares cuando estés $glisto:lista;.', '', '', '', '', '', '', 33528),
(53890, 'esES', 'Nuevos aliados, nuevos problemas', 'Averigua qué preocupa al comandante Dresh, a la guardafilada Sonji y a la primera arcanista Thalyssra.', 'Baine está muy ocupado. Aceptar a nuevos aliados implica afrontar nuevos problemas.\n\nAverigüemos qué preocupa a los integrantes de la Horda y veamos qué podemos hacer para ayudar.\n\nTal vez cuando no esté tan abrumado, Baine será capaz de comprender lo que valemos.', '', '', '', '', '', '', 33528),
(53889, 'esES', 'Una declaración de intenciones', 'Presencia la declaración de Kiro de su intención de unirse a la Horda.', 'Nuestra caravana está lista para explorar el mundo que hay más allá de las arenas, pero la hoja de Nisha no puede ser nuestra única defensa contra los peligros que sabemos que nos esperan.\n\nA eso hemos venido.\n\nA declarar nuestra intención de unirnos a la Horda.', '', '', '', '', '', '', 33528),
(53870, 'esES', 'Visita en el Fuerte Grommash', 'Reúnete con tu visita en el Fuerte Grommash.', '$p, me han informado de que una caravana vulpera ha llegado al Fuerte Grommash. Quieren hablar con la Horda y han solicitado tu presencia.\n\nMe temo que no es el mejor momento para recibir visitas, así que ve a verlos lo antes posible.', '', '', '', '', '', '', 33528),
