(52240, 'esES', 'El jardín del páramo', 'Derrota a la trituradora monstruosa.', 'Malditos sean esos goblins y sus máquinas infernales.\n\nEstán utilizando una trituradora para profanar nuestra arboleda sagrada.\n\n¡Debemos acabar con esa monstruosidad!', '', '¡Detén a esa cosa antes de que destruya el Páramo de los Ancianos!', 'Trituradora monstruosa', '', '', 'Reúnete con Delaryn en el interior del Páramo de los Ancianos.', 33528),
