INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(49991, 'esES', '¡El precio divertido de las caídas divertidas de Piesplumas!', 'Paga 100 de oro a Quinsy Piesplumas y te lanzará Caída lenta siempre que estés cerca.', '¡$gBienvenido:Bienvenida; a Zuldazar, mi $gbuen amigo:buena amiga; $pr!\n\nHe explorado cada rincón de esta maravillosa ciudad con mis propios pies. Y te diré una cosa: ¡están cansados!\n\nPor eso he decidido prestar un servicio a mis poderosos amigos de la Horda: ¡las caídas divertidas de Piesplumas!\n\nSí, ya sé lo que estás pensando. Uno normalmente asocia caer con gritos, dolor y una muerte prematura.\n\n¡PERO CON PIESPLUMAS NO!\n\nPor una única y módica suma, me aseguraré de que siempre bajes flotando por este zigurat de un modo seguro y divertido.', '', '', '', '', '', '', 33528),
(48176, 'esES', 'Gran golpe en Pequeña Tortolla', 'Habla con Toki en Pequeña Tortolla.', 'Recibí un mensaje en el que nos pedían ayuda en Pequeña Tortolla. El rey Rastakhan siente gran admiración por los Buscadores Tortolianos, a quienes ha concedido privilegios especiales.$b$bVe a ver qué quieren y obtendrás el favor del Rey.$b$bY $p, sé $grespetuoso:respetuosa;. Los tortolianos viven bastante tiempo como para hacer a los hijos de tus hijos responsables de tus actos.', '', '', '', '', '', '', 33528),
