(45405, 'esES', 'Irrupción en el Santuario', 'Habla con Oculeth para empezar el ataque.', 'Es la hora. Valtrois está lista para destruir el escudo que protege la brecha que hay en el Santuario. Yo te teletransportaré a la brecha, y tú te ocuparás de asegurar la zona.$b$bToma estos orbes de telemancia. Si ves que necesitas apoyo, úsalos para invocar a Marchitos.$b$bDebemos atacar antes de que el enemigo pueda preparar nuevas defensas. Habla conmigo cuando quieras empezar.', '', '', '', '', '', '', 33528),
(45053, 'esES', 'Instrucciones del ladrón', 'Lleva las instrucciones al Consejo de los Seis en Dalaran.', 'La nota garabateada con prisas dice:\n\n\"Necesito el iris de enfoque para uno de mis hechizos. Demuestra que eres de mis mejores aprendizos y tráemelo.\n\n¡Ah! Y asegúrate de no dejar esta nota tirada por ahí para que la encuentre algún aventurero.\"\n\nSi alguien pretende robar el iris de enfoque, seguramente el Kirin Tor querrá saberlo.', '', '', '', '', '', '', 33528),
