(31526, 'esES', 'Un desafío digno: Durand', 'Completa el Monasterio Escarlata en modo desafío.', '$n, necesito que reúnas un grupo fuerte y lo lleves al Monasterio Escarlata. Activa el orbe de contendiente que hay dentro y machaca a Durand con toda tu furia.$B$BVuelve aquí cuando hayas completado este desafío y te recompensaré generosamente.', '', '', '', '', '', '', 33528),
(27925, 'esES', 'Excavaciones fructíferas', 'Lleva \'Excavaciones fructíferas\' a Belloc Hoja Brillante en el Embarcadero de Schnottz.', 'Este manual describe teorías descabelladas sobre cómo gestionar de forma eficaz a grandes grupos de trabajadores que se dedican a las labores manuales de diferentes tipos de excavaciones.$b$bEs evidente que el autor de este libro es el encargado de estos saqueadores tremendamente agresivos.$b$bTal vez deberías presentarte.', '', 'No cabe duda de que esta imagen es la del narcisista autor.', '', '', '', '', 33528),
(8852, 'esES', 'Diez sellos para los suministros bélicos', '', '', '', '', '', '', '', '', 33528),
(8847, 'esES', 'Diez sellos para los suministros bélicos', '', '', '', '', '', '', '', '', 33528),
(8538, 'esES', 'Los cuatro Duques', 'Invoca y mata al duque de las Brasas, al duque de las Profundidades, al duque de los Céfiros y al duque de las Esquirlas y preséntate ante el comandante Mar\'alith en el Fuerte Cenarion. También debes llevar el Informe de tareas tácticas V para poder completar la misión.', 'Los vínculos entre el Martillo Crepuscular y el Consejo Abisal están demostrando ser más importantes de lo que habíamos pensado.$B$BCreemos que los nobles elementales conocidos como los Duques Abisales, son una de las fuerzas principales que organizan a los adeptos del Martillo Crepuscular. Encuentra la forma de atraer a los cuatro duques Abisales a nuestro plano de existencia y destrúyelos.$B$BLa dedicación y habilidad que has demostrado en misiones pasadas, nos han llevado a elegirte para esta misión en particular. Estamos seguros de que tendrás éxito.', '', '', '', '', '', '', 33528),
(8523, 'esES', '¡La Alianza necesita más vendas de paño rúnico!', 'Llévale 20 vendas de paño rúnico al vigilante Sombra Lunar en la base aérea de Dun Morogh.', 'Volvemos a encontrarnos para hablar de asuntos urgentes, $c. Una vez más, te agradezco los esfuerzos realizados anteriormente; no todos habrían prestado su ayuda tan desinteresadamente. Pero todavía queda trabajo pendiente.$B$B$n, ¿podrías conseguir más vendas de paño rúnico y traérmelas aquí?', '', '', '', '', '', '', 33528),
