(7623, 'esES', 'Lord Pesadilla', 'Cómprale pociones enigmáticas a Gorzeeki Ojovago en el Altar de la Tempestad en Las Estepas Ardientes.$B$BUsa las pociones para viajar por Jaedenar en Frondavil y habla con Lord Pesadilla en el interior de la Guarida Sombría.', 'Mor\'zul dice que quieres abrir un portal a Xoroth. Para ello, necesitarás polvo estelar xorothiano. ¡No es fácil de encontrar en Azeroth!$B$BHay un ser que podría tener algo de este polvo: Lord Pesadilla en Jaedenar, el miembro del Consejo de la Sombra! Habla con él y puede que te dé algo de polvo estelar.$B$BAunque si vas a Jaedenar, tendrás que revestirte del toque maligno del Consejo de la Sombra. Para ello, hará falta alguna de mis pociones enigmáticas y eso te costará...', '', '', '', '', '', '', 33528),
(6001, 'esES', 'Cuerpo y corazón', 'Utiliza el polvo de luna Cenarion en la piedra de lechúcico lunar de Auberdine para invocar a Garraluna. Luego tendrás que enfrentarte a Garraluna y ganar la fuerza física y de corazón que posee. $B$BCuando hayas acabado, vuelve a Darnassus y habla con Mathrengyl Garroso.', 'Al este de Auberdine hay muchas cuevas de lechúcicos lunares. La que está más cerca de Auberdine alberga una piedra de lechúcico lunar en su interior. Garraluna, el guardián de la piedra, solo se enfrentará a ti cuando le apliques polvo de luna Cenarion. Garraluna posee una fuerza que debes usar como miembro de la zarpa.$B$BTe has ganado el derecho a usar este polvo de luna Cenarion, $n... ¡Ahora demuéstrame que también te has ganado el derecho a poseer la fuerza física y de corazón que necesitas como druida!', 'Enfréntate a Garraluna y hazte con la fuerza de cuerpo y corazón que posee', '', '', '', '', 'Vuelve con: Mathrengyl Garroso. Zona: Enclave Cenarion, Darnassus.', 33528),
(4788, 'esES', 'Las últimas tablillas', 'Llévale la quinta y sexta tablillas Mosh\'aru al prospector Ferrobota, que está en Tanaris.', 'Mientras yo examino la tercera y cuarta tablillas Mosh\'aru, ¡tú tienes que encontrar la quinta y la sexta! No será fácil pues obran en poder de los trols Espina Ahumada en Cumbre de Roca Negra. Esta cumbre es una oscura montaña de fuego situada entre Las Estepas Ardientes y La Garganta de Fuego.$B$BBuena suerte, $n. Cumbre de Roca Negra no es un lugar para pundonorosos...', '', '', '', '', '', '', 33528),
(2440, 'esES', 'Los discos de platino', 'Llévale este vale de recompensa a Bena Pezuña Invernal, que está en Cima del Trueno.', 'Concentraré mis energías en estos discos pues tarde o temprano me acabarán revelando su auténtico propósito.$B$BEn cuanto a ti, $n, te recompensaré por haberme informado con tanta presteza. Entrégale este vale a Bena Pezuña Invernal, la instructora de alquimia de Cima del Trueno. Ella te dará un objeto muy especial que confío te resultará tentador y te entregará una selección de pociones de mi reserva personal.$B$BVuelve pronto a mi lado pues presiento que nos quedan muchas cosas por hacer en relación a este hallazgo.', '', '', '', '', '', '', 33528),
(1125, 'esES', 'Los espíritus de Viento del Sur', 'Libera los espíritus de 8 druidas torturados y 8 centinelas torturados en la Aldea del Viento del Sur. A continuación, reúnete con Layo Golpe Estelar en el cementerio de Sosiego del Valor en Silithus.', 'Al suroeste de aquí hay un lugar trágico, las ruinas de la Aldea del Viento del Sur. Ahí es donde deberíamos empezar a trabajar, $n.$B$BPor lo que he descubierto, antiguamente, esa aldea era una base de operaciones de los elfos de la noche en Silithus. Mucho tiempo atrás fue tomada por las colmenas de silítidos que infestan los restos. Solo puedo imaginarme el horror de la destrucción de la aldea...$B$BLos espíritus torturados de los druidas y centinelas caídos, vagan por las ruinas sin rumbo fijo. Explora el lugar y libera las almas de esos pobres seres.', '', '', '', '', '', '', 33528),
(730, 'esES', '¿Problemas en Costa Oscura?', 'Viaja a Auberdine y busca rastros del equipo de excavación enano.', 'Me agrada ver a $gun:una; $c mostrando interés por las grandes maravillas arqueológicas de nuestro mundo.$B$BA menudo nuestro trabajo es considerado poco más que una afición por nuestros amigos de la Alianza. Pero es porque no se dan cuenta de que son los recientes descubrimientos de Khaz Modan los que han probado que una poderosa fuerza amenaza todo Azeroth, de Lordaeron a Kalimdor.$B$BEmpiezo a preocuparme de verdad por el personal que envié a Costa Oscura. Hace semanas que no tengo noticias suyas.$B$BViaja a Auberdine y busca pistas de su paradero.', '', '', '', '', '', '', 33528),
(336, 'esES', 'Una noble cerveza', 'Lleva la cerveza Zarpanegra a lord Wishock en la Sala de los Ruegos.', 'Lord Wishock, como todos los hombres, tiene sus puntos débiles. Y, resulta que su punto más débil es el licor. La hipocresía es asombrosa. El pobre necio pasa sus días intentando cerrar nuestra pequeña \"taberna\" y las noches arriba, bebiendo y aumentando una cuenta que nunca paga. Bueno, veamos qué le parece a Wishock este brebaje especial que le he preparado: cerveza Zarpanegra. Es bastante fuerte, $n.$B$BLlévasela y veamos si le gusta. Lo más probable es que el viejo tonto esté dando vueltas por la Sala de los Ruegos.', '', '', '', '', '', '', 33528);
